insert  into `tbl_knowledge_center` values (3,'Sex,Sexuality and Gender','Refers to a Trans person (male-to-female transgender individuals). The Supreme Court in April 2014 recognized Hijra and Transgender people as a \'third gender\' in law. Hijra is a community of male to female transgender individuals who stay together, usually in a Dera, in India. The community follows rules and customs to maintain their identity.   A self-identified term used by males who define themselves as \"not men/not women\" but as a \"third gender.\" Hijras cross-dress publicly and privately and are a part of a social, religious, and cultural community. Ritual castration may be part of the hijra identity, but not all Hijras are castrated/emasculated. Sex with men is common. They also have their own language, known as ulti.',NULL,1,'2017-01-05 12:53:16','N'),(6,'Stigma','Refers to a Trans person (male-to-female transgender individuals). The Supreme Court in April 2014 recognized Hijra and Transgender people as a \'third gender\' in law. Hijra is a community of male to female transgender individuals who stay together, usually in a Dera, in India. The community follows rules and customs to maintain their identity.   A self-identified term used by males who define themselves as \"not men/not women\" but as a \"third gender.\" Hijras cross-dress publicly and privately and are a part of a social, religious, and cultural community. Ritual castration may be part of the hijra identity, but not all Hijras are castrated/emasculated. Sex with men is common. They also have their own language, known as ulti.',NULL,1,'2017-01-05 12:53:23','N'),(5,'STI and STD','Refers to a Trans person (male-to-female transgender individuals). The Supreme Court in April 2014 recognized Hijra and Transgender people as a \'third gender\' in law. Hijra is a community of male to female transgender individuals who stay together, usually in a Dera, in India. The community follows rules and customs to maintain their identity.