 style=\"white-space:pre\"></span>सम्भोग के समय में दर्द <br></span></span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: \" kruti=\"\" dev=\"\" 010\";=\"\" font-size:=\"\" 16px;=\"\" font-weight:=\"\" bold;\"=\"\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>जननांग में सूजन <br></span></span></li></ul><ul><li style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: \" kruti=\"\" dev=\"\" 010\";=\"\" font-size:=\"\" 16px;=\"\" font-weight:=\"\" bold;\"=\"\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>पेट के निचले हिस्से में दर्द <br></span></span></li></ul><span style=\" color: rgb(0, 0, 0);\"><span style=\" font-family: \" kruti=\"\" dev=\"\" 010\";=\"\" font-size:=\"\" 16px;=\"\" font-weight:=\"\" bold;\"=\"\"></span></span><ul><li style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\">लिंग से रिसाव ( हरा, पीला या पस्स जैसा दिखने वाला तरल पदार्थ )</span></li></ul><span style=\" color: rgb(0, 0, 0);\"></span><ul><li style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\">ग्रंथियोंध् लिंक में सूजन या दर्द</span></li></ul><span style=\" color: rgb(0, 0, 0);\"></span><ul><li style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\">जननांग में फोड़ा या घाव, जो की दर्दनाक हो भी सकता हैं और नहीं भी</span></li></ul><span style=\" color: rgb(0, 0, 0);\"></span><ul><li style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\">शरीर में गांठ <br></span></li></ul><span style=\" color: rgb(0, 0, 0);\"></span><ul><li style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\">मुँह में फोड़ा <br></span></li></ul><span style=\" color: rgb(0, 0, 0);\"></span><ul><li style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\">मौखिक एस.टी.आई. में लंबे समय के लिए खासी <br></span></li></ul><span style=\" color: rgb(0, 0, 0);\"></span><ul><li style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\">अंडकोष में भारीपन या परेशानी</span></li></ul><span style=\" color: rgb(0, 0, 0);\"></span><ul><li style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\">गुदा में दर्द या खुजली या जलन होना</span></li></ul><span style=\" color: rgb(0, 0, 0);\"><br></span><br><span style=\" color: rgb(0, 0, 0);\"><span style=\" font-family: \" kruti=\"\" dev=\"\" 010\";=\"\" font-size:=\"\" 16px;=\"\" font-weight:=\"\" bold;\"=\"\"><br></span></span><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\"></span></p>','','N'),(11,5,'<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\njustify;text-justify:inter-ideograph;line-height:normal\"><b><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"color: rgb(156, 0, 255);\">What\nare STI and STD ?</span></span></b></p><ul><li style=\"line-height: 2;\"><!--[if !supportLists]--><span style=\"font-size:10.0pt;line-height:115%;font-family:Wingdings;\nmso-fareast-font-family:Wingdings;mso-bidi-font-family:Wingdings;mso-ansi-language:\nEN-IN\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">\n</span></span><!--[endif]--><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">An\nSTD or Sexually Transmitted Disease is transmitted through unsafe sex with an\ninfected person. <br></span></span></li></ul><span style=\"color: rgb(0, 0, 0);\"><span style=\" font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"></span></span><ul><li style=\"line-height: 2;\"><!--[if !supportLists]--><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size:10.0pt;line-height:115%;font-family:Wingdings;\nmso-fareast-font-family:Wingdings;mso-bidi-font-family:Wingdings;mso-ansi-language:\nEN-IN\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">\n</span></span></span><!--[endif]--><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"color: rgb(0, 0, 0);\">An\nSTI or Sexually Transmitted Infection becomes an STD once the signs and\nsymptoms of the infection are noticed and visible. </span><br></span></li></ul><span style=\" font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><br></span><p style=\"line-height: 2;\">\n\n\n\n\n\n</p><p class=\"MsoNormal\" style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\"><b><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Do not leave STIs/STDs untreated. If untreated, STDs\ncan cause cancers, chronic hepatitis and other complications.</span></b></span><span style=\"mso-bidi-font-size:10.0pt;line-height:115%;mso-bidi-font-family:\" arial=\"\" unicode=\"\" ms\";=\"\" mso-bidi-language:hi\"=\"\"><o:p></o:p></span></p>','','<p><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-weight: bold;\">एस.टी.आई. व एस.टी.डी. क्या है ?</span></span></p><ul><li style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\">एस.टी.डी. यौन रोग से संक्रमित व्यक्ति के साथ असुरक्षित यौन सम्बन्ध बनाने से फैलता है, जब यौन संक्रमण के संकेत या लक्षण दिखने लगे तो वह यौन रोग कहलाता है। <br></span></li></ul><p style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\"><br></span></p><ul><li style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\">एस.टी.आई., एस.टी.डी. का इलाज जरूर करवाना चाहिए। समय पर इलाज न कराने से एस.टी.आई. व एस.टी.डी. लाइलाज बीमारी का रूप ले सकते है।</span></li></ul><p style=\"line-height: 2;\"><br></p>','','N'),(12,5,'<p class=\"MsoNormalCxSpFirst\" style=\"margin-bottom:3.0pt;mso-add-space:auto;\ntext-align:justify;text-justify:inter-ideograph\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-weight: bold;\"><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">What are symptoms of common STIs? <o:p></o:p></span></span></span></span></p><p class=\"MsoNormal\" style=\"text-align: justify; line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-weight: bold;\">Gonorrhoea</span>:</span><span style=\"color: rgb(0, 0, 0);\"> Caused by a bacterium\nthat is found in moist areas of the genitals, urine canal of both men and\nwomen. It can also infect the anus (opening from where the human waste exists\nthe body), the mouth and the throat. <o:p></o:p></span></span></span></p><p style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">\n\n\n\n\n\n<span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Symptoms include burning or pain during urination, abnormal white,\nyellow or green discharge from the penis and painful/swollen testicles, rectal\npain and itching, bleeding or discharge from the anus.</span></span></span></p><p style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><br></span></span></span></p><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"font-size:12.0pt;mso-bidi-font-size:10.0pt;line-height:115%;\nfont-family:\" times=\"\" new=\"\" roman\",\"serif\";mso-fareast-font-family:\"times=\"\" roman\";=\"\" mso-ansi-language:en-in\"=\"\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span></span><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"font-weight: bold;\"><span style=\"color: rgb(156, 0, 255);\">Syphilis:\n</span></span><o:p></o:p></span></span></span><!--[endif]--><p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\">·<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">        \n</span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Primary\nsyphilis- it is a small painless red bump at the site of infection. Mostly on\nthe external genitalia, cervix, mouth or anal canal; The symptoms can vanish in\na very short period of time on its own, without medication. But the infection\npersists to stay in the body and can spread to others. <o:p></o:p></span></span></span><!--[endif]--></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\">·<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">        \n</span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Secondary\nSyphilis- flu-like symptoms and a rash that resembles measles but doesnot itch\nor hurt. In this stage, the symptoms appear for a longer period of time and\nagain vanish on their own. But the infection persists to stay in the body and\ncan spread to others. <o:p></o:p></span></span></span><!--[endif]--></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\">·<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">        \n</span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Tertiary\nsyphilis- in this stage the bacteria will damage the heart, eyes, bones, brain\nor almost any part of the body. <o:p></o:p></span></span></span><!--[endif]--></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\">·<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">        \n</span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">A\nperson could be in the “at risk” category of getting syphilis if:<o:p></o:p></span></span></span><!--[endif]--></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in 0in 0.0001pt 0.75in; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[if !supportLists]--></p><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span></span><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Engaged in unsafe\npenetrative sex (without condom) with a person who is carrying the infection\nvia vaginal, oral or anal sex<o:p></o:p></span></span></span></li></ul><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in 0in 0.0001pt 0.75in; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[endif]--></p><p style=\"line-height: 2;\">\n\n\n\n\n\n\n\n\n\n\n\n</p><p class=\"MsoListParagraphCxSpLast\" style=\"margin-left: 0.75in; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[if !supportLists]--></p><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Untreated\nsexual partner whose tested positive for syphilis;<o:p></o:p></span></span></span></li></ul><p class=\"MsoListParagraphCxSpLast\" style=\"margin-left: 0.75in; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[endif]--></p><span style=\"font-family: Arial Black;\"><span style=\" font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\" color: rgb(0, 0, 0);\"><br></span></span></span>','','<p style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(156, 0, 255); font-weight: bold;\">कुछ आम एस.टी.आई. (यौन रोग) के लक्षणः-</span></span></p><p style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(156, 0, 255); font-weight: bold;\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>गानोरिया:-</span><span style=\"color: rgb(156, 0, 255);\"> <span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>यह किसी भी पुरुष या स्त्री के मूत्रस्थान या गुप्तांग के गीले छेत्र में कीटाणु के रूप में पाया जाता हैं। यह किसी के गुदे (जहा से मानव का मल निकलता हैं) को, मुँह को या गले को संक्रमित कर सकता हैं।</span></span></span></p><p style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(156, 0, 255);\"><span style=\"color: rgb(0, 0, 0);\"></span></span><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>मूत्रत्याग के समय जलन या दर्द, लिंग से सफेद, पीला या हरा तरल पदार्थ निकलना, अंडकोष (टेस्टिकल्स) में दर्द या सूजन, गुदा में दर्द या खुजली या खून निकलना सभी गानोरिया के लक्षण हैं।</span></span></p><p style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><br></span></span></p><p style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-weight: bold;\"><span style=\"color: rgb(156, 0, 255);\">सिफिलिसः</span></span> यह तीन प्रकार के होते हैं:</span></span></p><p style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">प्रारंभिक सिफिलिसः इसमें संक्रमण के स्थान में एक छोटा सा दाना आ जाता है जो कि दर्दनाक नहीं होता है। यह ज्यादातर बाहरी जननांग, गले में, मुह में या गुदा में होता है। ये लक्षण बहुत ही काम समय के लिए होते है और खुद ही मिट जाते है बिना दवाइयों का सेवन किये। परंतु इसका संक्रमण शरीर में रहता है और दुसरो में भी फैल सकता है।  </span></span></p><p style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">माध्यमिक सिफिलिसः इसके लक्षण फ्लू की तरह होते है और कभी कभी फुंसी भी आ जाती है जो की दर्द या खुजली नहीं देती है। इस अवस्था में लक्षण बहुत जड़ समय के लिए दिखते है और खुदबखुद मिट जाते है। परंतु इसका संक्रमण शरीर में रहता है और दुसरो में भी फैल सकता है।  </span></span></p><p style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>तृतीय श्रेणी का सिफिलिस: इस श्रेणी में जीवाणु ऋदय, आँखों, हड्डियों, दिमाग और अधिकतर शरीर के हर अंग को क्षति पहुँचाना शुरू कर देते है।</span></span></p><p style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">व्यक्ति सिफिलिस के जोखिम की स्थिति में हो सकता है अगर:</span></span></p><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">वह व्यक्ति जो कंडोम के बिना अपना लिंग किसी अन्य व्यक्ति के ग्रसित योनि, गुदे या मुख में प्रवेश करे या उसे ग्रहण करे। </span></span></li></ul><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>ऐसे साथी के साथ असुरक्षित सम्भोग करना जो सिफलिस़ हो तथा उसने इलाज शुरू ना किया हो।</span></span></li></ul><p style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">सिफिलिस से होने वाले झोखिम से बचने के लिए हमेशा सुरक्षित सम्भोग किया जाये और हमशा कंडोम का इस्तेमाल किया जाये।</span></span></p><div style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><br></span></div><p style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><br></span></span></p><p style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><br></span></span></p>','','N'),(13,5,'<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 2;\"><span style=\"font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"font-weight: bold;\"><span style=\"color: rgb(156, 0, 255);\">Chlamydia:</span> </span>This is a bacterial\ninfection that infects the genitals, anus or the throat. Majority of the\ninfected people have no symptoms. <o:p></o:p></span></span></span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left: 0.25in; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[if !supportLists]--><span style=\"font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size:10.0pt;\nline-height:115%;font-family:\" times=\"\" new=\"\" roman\",\"serif\";mso-fareast-font-family:=\"\" \"times=\"\" roman\";mso-ansi-language:en-in\"=\"\" lang=\"EN-IN\">•<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">         \n</span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">A\nmajority of people do not notice signs of Chlamydia. However, those who\nexperience symptoms will face the following: \n<o:p></o:p></span></span></span><!--[endif]--></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 22.5pt; text-align: justify; text-indent: -13.5pt; line-height: 2;\"><!--[if !supportLists]--></p><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">White\nor cloudy discharge from the penis, <o:p></o:p></span></span></span></li></ul><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 22.5pt; text-align: justify; text-indent: -13.5pt; line-height: 2;\"><!--[endif]--></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 22.5pt; text-align: justify; text-indent: -13.5pt; line-height: 2;\"><!--[if !supportLists]--></p><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">\n</span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Burning\nwhen urinating, <o:p></o:p></span></span></span></li></ul><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 22.5pt; text-align: justify; text-indent: -13.5pt; line-height: 2;\"><!--[endif]--></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 22.5pt; text-align: justify; text-indent: -13.5pt; line-height: 2;\"><!--[if !supportLists]--></p><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Burning\nor itching around penis<o:p></o:p></span></span></span></li></ul><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 22.5pt; text-align: justify; text-indent: -13.5pt; line-height: 2;\"><!--[endif]--></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 22.5pt; text-align: justify; text-indent: -13.5pt; line-height: 2;\"><!--[if !supportLists]--></p><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"> \n</span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Inflammation,\ntenderness and pain in and around the testicles.<o:p></o:p></span></span></span></li></ul><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 22.5pt; text-align: justify; text-indent: -13.5pt; line-height: 2;\"><!--[endif]--></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 22.5pt; text-align: justify; text-indent: -13.5pt; line-height: 2;\"><!--[if !supportLists]--></p><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Rectal\npain, discharge and bleeding<o:p></o:p></span></span></span></li></ul><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 22.5pt; text-align: justify; text-indent: -13.5pt; line-height: 2;\"><!--[endif]--></p><p class=\"MsoListParagraphCxSpLast\" style=\"margin-left: 22.5pt; text-align: justify; text-indent: -13.5pt; line-height: 2;\"><!--[if !supportLists]--></p><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">  </span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Conjunctivitis (eyes)<o:p></o:p></span></span></span></li></ul><p class=\"MsoListParagraphCxSpLast\" style=\"margin-left: 22.5pt; text-align: justify; text-indent: -13.5pt; line-height: 2;\"><!--[endif]--></p><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial;\"><span style=\"color: rgb(0, 0, 0);\">\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n<span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Throat infection</span></span><br></span></li></ul>','','<p><span style=\"color: rgb(156, 0, 255); font-weight: bold;\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>क्लमीडिया से होने वाला संक्रमण है -</span></p><p style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\">यह एक कीटाणु है जो जननांग, गुदा और मुख को ग्रसित करता है। ज्यादातर लोग जो संक्रमित हो जाते है उन्हें लक्षणों के बारे में पता नहीं चलता है। लेकिन जिनमें लक्षण दिखते है वे निम्न लक्षण हो सकते है -</span></p><ul><li><span style=\"color: rgb(156, 0, 255); font-weight: bold;\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span></span><span style=\"color: rgb(0, 0, 0);\">सफेद और गाढ़ा पदार्थ लिंग से रिसना</span></li></ul><span style=\" color: rgb(0, 0, 0);\"><br></span><ul><li><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>पेशाब में जलन होना</span></li></ul><span style=\" color: rgb(0, 0, 0);\"><br></span><ul><li><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>लिंग के आसपास खुजली या जलन होना</span></li></ul><span style=\" color: rgb(0, 0, 0);\"><br></span><ul><li><span style=\"color: rgb(0, 0, 0);\">अंडकोष (टेस्टीकलस) के पास जलन या दर्द का होना</span></li></ul><span style=\" color: rgb(0, 0, 0);\"><br></span><ul><li><span style=\"color: rgb(0, 0, 0);\">गुदा में दर्द और खून का रिसना <br></span></li></ul><span style=\" color: rgb(0, 0, 0);\"><br></span><ul><li><span style=\"color: rgb(0, 0, 0);\">कंजंक्टिवाइटिस (आंख आना)</span></li></ul><span style=\" color: rgb(0, 0, 0);\"><br></span><p style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space: pre;\"></span></span></p><ul><li><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>गले में संक्रमण</span></li></ul><div style=\"line-height: 2;\"><br></div><div><br></div>','','N'),(14,5,'<span style=\"font-family: Arial Black;\"><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"font-weight: bold;\"><span style=\"color: rgb(156, 0, 255);\">HIV/AIDS:</span></span><span style=\"color: rgb(0, 0, 0);\"> A person infected with HIV develops an\nillness called primary infection, which is like flu. The symptoms of primary\ninfection include </span><o:p></o:p></span></span><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Fever<br></span></span></span></li></ul><ul><li style=\"line-height: 2;\"><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Muscle\naches <br></span></span></span></li></ul><ul><li style=\"line-height: 2;\"><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Rash</span></span></span></li></ul><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 22.5pt; text-align: justify; text-indent: -13.5pt; line-height: 2;\"><!--[if !supportLists]--></p><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Headaches\nand swollen lymph nodes<o:p></o:p></span></span></span></li></ul><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 22.5pt; text-align: justify; text-indent: -13.5pt; line-height: 2;\"><!--[endif]--></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in 0in 3pt 40.5pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size:10.0pt;line-height:115%;font-family:\" courier=\"\" new\";=\"\" mso-fareast-font-family:\"courier=\"\" new\";mso-ansi-language:en-in\"=\"\" lang=\"EN-IN\">o<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">   </span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Symptoms\nof multiple infections generally reappear when HIV infection has reached its\nfinal stage (AIDS).</span></span></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in 0in 3pt 40.5pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><br></span></span></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in 0in 3pt 40.5pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size:10.0pt;line-height:115%;font-family:\" courier=\"\" new\";=\"\" mso-fareast-font-family:\"courier=\"\" new\";mso-ansi-language:en-in\"=\"\" lang=\"EN-IN\">o<span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">   \n</span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">The\nperson is known to have AIDS only when an HIV infected person’s CD4 count has\ngone below 500. <br></span></span></span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left: 22.5pt; text-align: justify; text-indent: -13.5pt; line-height: 2;\"><!--[if !supportLists]--></p><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span