;\" lang=\"EN-IN\"><o:p> </o:p></span></b></span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:27.0pt;mso-add-space:\nauto;text-align:justify;text-justify:inter-ideograph;text-indent:-.25in;\nmso-list:l0 level1 lfo2\"><!--[if !supportLists]--></p><ul><li><span style=\"font-family: Arial Black;\"><span style=\"font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">\n</span></span><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Get\nto a doctor at the earliest and talk openly about the problem being faced<o:p></o:p></span></span></span></li></ul><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:27.0pt;mso-add-space:\nauto;text-align:justify;text-justify:inter-ideograph;text-indent:-.25in;\nmso-list:l0 level1 lfo2\"><!--[endif]--></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:27.0pt;mso-add-space:\nauto;text-align:justify;text-justify:inter-ideograph;text-indent:-.25in;\nmso-list:l0 level1 lfo2\"><!--[if !supportLists]--></p><ul><li><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial Black;\"><span style=\"font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">\n</span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Follow\nthe instructions of the doctor and complete the tests/treatment prescribed;<o:p></o:p></span></span></span></li></ul><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:27.0pt;mso-add-space:\nauto;text-align:justify;text-justify:inter-ideograph;text-indent:-.25in;\nmso-list:l0 level1 lfo2\"><!--[endif]--></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:27.0pt;mso-add-space:\nauto;text-align:justify;text-justify:inter-ideograph;text-indent:-.25in;\nmso-list:l0 level1 lfo2\"><!--[if !supportLists]--></p><ul><li><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial Black;\"><span style=\"font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"> \n</span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Use\ncondoms regularly at each sex act (oral, vaginal, and anal) even with regular\npartner;</span></span></span></li><li><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial Black;\"><a style=\"text-align: justify; text-indent: -0.25in; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"> <span style=\"color: rgb(0, 0, 0);\"></span></span></span><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Always\nask for screening of STI once in every three months (in case of multiple sexual\npartners or inconsistent condom use or forced sex);</span></span></a></span></span></li><li><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial Black;\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"> </span><span style=\"text-align: justify; text-indent: -0.25in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\">Be\nsure to finish all of medicine, even if there is improvement in health.</span></span></span></li><li><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial Black;\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"> </span><span style=\"text-align: justify; text-indent: -0.25in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\">Sexual\npartner should also be tested and treated</span></span></span></li><li><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial Black;\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"> </span><span style=\"text-align: justify; text-indent: -0.25in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\">Remember,\nMost of the STIs are treatable</span><span style=\"text-align: justify; text-indent: -0.25in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; line-height: 115%; font-size: 10.6667px;\" lang=\"EN-IN\">.</span></span></span></li></ul><p><br></p><p><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-weight: bold;\"><span style=\"font-family: Arial Black;\">When do the tests for STI/STD show results ?</span></span></span><br></p><ul><li><span style=\"color: rgb(0, 0, 0);\"></span><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial Black;\"><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">STIs\nonly show up on the tests a few weeks after the incident. This is because these\ntests are looking for the virus or bacteria in the infected body. Instead, they\nsearch for the antibodies that the person’s immune system has created to fight\noff the infection. <br></span></span></span></li></ul><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial Black;\"><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"></span></span></span><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial Black;\"><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"></span></span></span><ul><li><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial Black;\"><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">It\ntakes the infected body a few days to create these antibodies, which means it\ntakes time for the test to pick on these infections. Each STI has a different\nwindow period between when it has entered and when it will show up on a test.</span></span></span><span style=\"color: rgb(0, 0, 0);\"></span><p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:27.0pt;mso-add-space:auto;\ntext-indent:-.25in;mso-list:l0 level1 lfo1\"><!--[endif]--></p><div><!--[if !supportAnnotations]--><span style=\"color: rgb(0, 0, 0);\">\n\n</span><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:27.0pt;mso-add-space:\nauto;text-align:justify;text-indent:-.25in;mso-list:l0 level1 lfo1\"><span style=\"font-family: Arial Black;\"><br></span></p>\n\n</div></li></ul>','','<p style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"></span><span style=\"font-weight: bold;\"><span style=\"color: rgb(156, 0, 255);\">एस.टी.डी. या एस.टी.आई. की जांच कब कराये ?</span></span></span></p><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>जब लक्षण आसानी से दिख रहे हो।</span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">जब नियमित तौर पर असुरक्षित संबंध बने।</span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>किसी नए यौन साथी से असुरक्षित यौन संबंध के बाद।</span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>असुरक्षित सम्भोग या यौन शोषण के बाद।</span></span></li></ul><p style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><br></span></span></p><p style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-weight: bold;\">एस.टी.डी. या एस.टी.आई. होने के जोखिम की स्थिति से गुजरने के बाद क्या करना चाहिए ?</span></span></span></p><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">जल्द से जल्द डॉक्टर से संपर्क करे और खुल के दिक्कतों के बारे में बात करे।</span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>डॉक्टर के दिए हुए निर्देशो का पालन करे और जांचो को पूरा कराये।</span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>सम्भोग (मौखिक, गुदा या योनिक) करते समय कंडोम का इस्तेमाल अवश्य करे। <br></span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">सम्भोग (खास तौर पर गुदा सम्भोग) करते समय पानी से बने पदार्थ वाले लुब्रीकेंट का इस्तेमाल करे।</span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>हर 3 महीने में इस टी आई की जांच कराना जरूरी हैं (अगर कई सम्भोग करने वाले साथी है या अनियमित कंडोम का उपयोग हो रहा हो या यौन शोषण)।</span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>पहले से बेहतर महसूस करने पर भी हमेशा दवाइयों का पूरा सेवन करे।<br></span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>सम्भोग करने वाले साथियो की भी जांच और उनका इलाज कराना भी जरूरी है।</span></span></li></ul><p><br></p><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-weight: bold;\"><span style=\"font-family: Arial Black;\">एस.टी.डी. या एस.टी.आई. की जांच का नतीजा कब आता है ?</span></span></span><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">असुरक्षित संभोग के पश्चात कुछ हफ्तों के उपरांत जाॅच करवानी चाहिए क्योंकि एस.टी.डी. या एस.टी.आई. का नतीजा तभी सही आता है। <br></span></span></li></ul><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"></span></span><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">इस जाॅच द्वारा हम यौन संक्रमण वाले विषाणुओं या कीटाणुओं का पता ना लगा कर हमारे शरीर में मौजूद एंटीबाडीस का पता लगाते है जो इस संक्रमण से लड़ते है।</span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">एंटीबाडीस बनने में कुछ दिनों का वक्त लगता है। हर यौन रोग का विन्डो पीरियड अलग होता है (विन्डो पीरियड वह समय होता है जब शरीर में कीटाणु या विषाणु प्रवेश करते है तथा जाॅच द्वारा उनका पता लगाया जा सकता है)।</span></span></li></ul><p style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><br></span></span></p><div style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><br></span></div>','','N'),(19,4,'<h4 class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial;\"><b><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"color: rgb(156, 0, 255);\">What\nis HIV?</span></span></b></span></span></h4><h4 class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial;\"><span style=\"font-weight: bold;\"><span style=\"font-weight: normal;\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">HIV (Human Immunodeficiency Virus) is a virus. It only affects human\nbeings. HIV directly attacks and destroys white blood cells called the CD4\ncells, which are part of the immune system (cells that help body to naturally\ndefend against illnesses). HIV thus disables the very cells on which the body\nrelies to fight off this infection and diseases. Someone who has HIV is said to\nbe ‘HIV+’ or ‘HIV positive.’ Blood contains the highest concentration of the\nvirus, followed closely by semen, followed by</span><span style=\"font-size:10.0pt;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin\" lang=\"EN-IN\">\n</span></span></span><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"font-weight: bold;\"><span style=\"font-weight: normal;\">vaginal fluids.</span></span></span></span></span></h4><p><br></p><h4 class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial;\"><b><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"color: rgb(156, 0, 255);\">What\nis AIDS?</span><o:p></o:p></span></b></span></span></h4><h4 class=\"MsoListParagraphCxSpFirst\" style=\"margin: 0in 0in 0.0001pt 27pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[if !supportLists]--></h4><ul><li style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial;\"><span style=\"font-size: 10pt;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span></span><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Acquired - one gets it\nfrom a person who is already infected- it cannot be passed on in our genes <br></span></span></span></li></ul><h4 class=\"MsoListParagraphCxSpFirst\" style=\"margin: 0in 0in 0.0001pt 27pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[endif]--></h4><h4 class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in 0in 6pt 27pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[if !supportLists]--></h4><ul><li style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial;\"><span style=\"font-size: 10pt;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">\n</span></span><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Immuno - it affects the\nimmune system that protects the body from infection <br></span></span></span></li></ul><span style=\" color: rgb(0, 0, 0);\"><span style=\" font-family: Arial;\"><span style=\" font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"></span></span></span><h4 class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in 0in 6pt 27pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[endif]--></h4><h4 class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in 0in 6pt 27pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[if !supportLists]--></h4><ul><li style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial;\"><span style=\"font-size: 10pt;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">\n</span></span><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Deficiency - the immune\nsystem is not working properly <br></span></span></span></li></ul><span style=\" color: rgb(0, 0, 0);\"><span style=\" font-family: Arial;\"><span style=\" font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"></span></span></span><h4 class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in 0in 6pt 27pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[endif]--></h4><h4 style=\"line-height: 2;\">\n\n\n\n\n\n\n\n\n\n\n\n\n\n</h4><h4 class=\"MsoListParagraphCxSpLast\" style=\"margin: 0in 0in 6pt 27pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[if !supportLists]--></h4><ul><li style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial;\"><span style=\"font-size: 10pt;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span></span><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Syndrome - a set or a\ngroup of symptoms - AIDS is not just one single disease</span></span></span></li></ul><span style=\" color: rgb(0, 0, 0);\"><span style=\" font-family: Arial;\"><span style=\" font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><br></span></span></span><h4 class=\"MsoListParagraphCxSpLast\" style=\"margin: 0in 0in 6pt 27pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[endif]--></h4>','','<h5><p class=\"MsoNormal\" style=\"margin-bottom: 3pt; line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(156, 0, 255);\"><span style=\"background-color: rgb(255, 255, 255);\"><span style=\"font-weight: normal;\"><span style=\"font-family: \" kruti=\"\" dev=\"\" 010\";=\"\" font-size:=\"\" 16px;=\"\" font-weight:=\"\" bold;\"=\"\">एच.आई.वी. क्या होता है ?</span></span></span></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 3pt; line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"font-weight: normal;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: \" kruti=\"\" dev=\"\" 010\";=\"\" font-size:=\"\" 16px;=\"\" font-weight:=\"\" bold;\"=\"\">एच.आई.वी. (ह्यूमन इम्यूनोडिफिशिएंसी वायरस) एक विषाणु है। ये सिर्फ इंसानो को प्रभावित करता है। एच.आई.वी. हमारे शरीर के व्हाइट ब्लड सेल्स जिनको सी डी 4 सेल्स भी कहते है, उनको खत्म करता है और इसकी वजह से हमारे शरीर की प्रतिरोधक शाक्ति खत्म होती जाती है। (यह वे सेल्स है जो कुदरती रूप से हमारे शरीर में पनप रही हर बीमारी से लड़ते हंै। वे व्यक्ति जिनको एच.आई.वी. होता है तथा उनको एच.आई.वी.़ निगेटिव या एच.आई.वी.़ पॉजिटिव कहते है। एक एच.आई.वी. संक्रमित व्यक्ति के रक्त में इस विषाणु की सबसे ज्यादा मात्रा पाई जाती है। वीर्य तथा योनि द्रव से भी इस की मात्रा अधिक होती है।</span></span></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 3pt; line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"font-weight: normal;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: \" kruti=\"\" dev=\"\" 010\";=\"\" font-size:=\"\" 16px;=\"\" font-weight:=\"\" bold;\"=\"\"><br></span></span></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 3pt; line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"font-weight: bold;\"><span style=\"font-weight: normal;\"><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-family: \" kruti=\"\" dev=\"\" 010\";=\"\" font-size:=\"\" 16px;=\"\" font-weight:=\"\" bold;\"=\"\">एड्स क्या है ?</span></span></span></span></span></p></h5><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: \" kruti=\"\" dev=\"\" 010\";=\"\" font-size:=\"\" 16px;=\"\" font-weight:=\"\" bold;\"=\"\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>अक्वायर्डः ये विषाणु रूप से नहीं फैलता है बल्कि ये एक व्यक्ति में किसी संक्रमित व्यक्ति द्वारा पहुचता है। <br></span></span></span></li></ul><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: \" kruti=\"\" dev=\"\" 010\";=\"\" font-size:=\"\" 16px;=\"\" font-weight:=\"\" bold;\"=\"\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>इम्मुनोः यह संक्रमित व्यक्ति के प्रतिरोधक शाक्ति तंत्र को खत्म करता है।</span></span></span></li></ul><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: \" kruti=\"\" dev=\"\" 010\";=\"\" font-size:=\"\" 16px;=\"\" font-weight:=\"\" bold;\"=\"\">डेफीसिएंसीयः इसमें संक्रमित व्यक्ति की बीमारियों से लड़ने की शक्ति में भारी कमी आ जाती है।</span></span></span></li></ul><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: \" kruti=\"\" dev=\"\" 010\";=\"\" font-size:=\"\" 16px;=\"\" font-weight:=\"\" bold;\"=\"\">सिंड्रोमः इसमें कई सारे लक्षण देखे जाते है - अपने आप में बीमारी न होकर कई बीमारियों का समूह है।</span></span></span></li></ul><h5 style=\"line-height: 2;\"><div style=\"line-height: 2;\"><br></div></h5>','','N'),(20,4,'<h4 class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 2;\"><span style=\"font-family: Arial Black;\"><b><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"color: rgb(156, 0, 255);\">How\ncan a person be at risk of HIV? </span><o:p></o:p></span></b></span></h4><h4 class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-weight: normal;\"><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">There\nis a risk that HIV can be passed from:</span></span></span></span></h4><h4 class=\"MsoListParagraphCxSpFirst\" style=\"margin: 0in 0in 0.0001pt 27pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[if !supportLists]--></h4><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">\n</span></span><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">One person to another\nthrough unprotected sex (sex without condom) since semen and vaginal fluids have\nhigh concentration of the virus<o:p></o:p></span></span></span></li></ul><h4 class=\"MsoListParagraphCxSpFirst\" style=\"margin: 0in 0in 0.0001pt 27pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[endif]--></h4><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Through sharing of\ninfected syringes/needles<o:p></o:p></span></span></span></li></ul><h4 class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in 0in 0.0001pt 27pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[endif]--></h4><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">From infected parents to\nchild through mother<o:p></o:p></span></span></span></li></ul><h4 class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in 0in 0.0001pt 27pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[endif]--></h4><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">From transfusion of\ninfected blood to an un-infected person</span></span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"font-size: 10pt;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">  </span></span><span style=\"color: rgb(0, 0, 0);\"><b><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">HIV will NOT spread by\ntouching, kissing, shaking hands, coughing and sharing cutlery or shaking\nhands. <br></span></b></span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><b><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"color: rgb(0, 0, 0);\">This is because HIV is\nnot an airborne, water borne or food-borne virus. Also, the virus does not\nsurvive for very long outside the human body. </span><o:p></o:p></span></b><b><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"></span></b></span></li></ul><h4 class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in 0in 0.0001pt 27pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[endif]--></h4><h4 class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in 0in 0.0001pt 45pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[endif]--></h4><span style=\"font-family: Arial Black;\"><br></span>','','<p style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(156, 0, 255); font-weight: bold;\">एच.आई.वी. से कैसे संक्रमित होते है ?</span></span></p><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(156, 0, 255);\"><span style=\"color: rgb(0, 0, 0);\">एच.आई.वी. संक्रमित व्यक्ति के साथ असुरक्षित यौन संबंध (बिना कंडोम) बनाने से।</span></span></span></li></ul><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">एच.आई.वी. संक्रमित सूईयों के सांझे इस्तेमाल से।</span></span></li></ul><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">संक्रमित माता-पिता से शिशु में माता द्वारा संक्रमण फैल सकता है।</span></span></li></ul><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"font-weight: bold;\"><span style=\"color: rgb(0, 0, 0);\">संक्रमित रक्त को चढ़ाने से। संक्रमित रक्त चढ़ाने से एच.आई.वी. का खतरा 100 प्रतिशत होता है।</span></span></span></li></ul><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"font-weight: bold;\"><span style=\"color: rgb(0, 0, 0);\">एच.आई.वी. छूने से, चुम्बन से, हाथ मिलाने से, खांसने से या बर्तनों के सांझे इस्तेमाल से नहीं फैलता है। यह विषाणु मानव शरीर के बाहर ज्यादा देर तक जीवित नहीं रह सकता है।</span></span></span></li></ul><div style=\"line-height: 2;\"><br></div>','','N'),(21,4,'<h5 class=\"MsoNormal\" style=\" margin-bottom: 0.0001pt; text-align: justify; line-height: 2;\"><span style=\"font-family: Arial Black;\"><b><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"color: rgb(156, 0, 255);\">What\nis a window period?</span><o:p></o:p></span></b></span><span style=\"font-family: Arial Black;\"><span style=\"font-weight: normal;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"></span></span></span></span></h5><h5 class=\"MsoNormal\" style=\" margin-bottom: 0.0001pt; text-align: justify; line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"font-weight: normal;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Window period is a period\nof 3-6 months where the virus is taking control of the immunity but is not\ndetected in the HIV test. <o:p></o:p></span></span></span></span></h5><p><br></p><h5 class=\"MsoListParagraph\" style=\" margin: 0in 0in 6pt 27pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[if !supportLists]--></h5><h5 class=\"MsoNormal\" style=\" margin-bottom: 0.0001pt; text-align: justify; line-height: 2;\"><span style=\"font-family: Arial Black;\"><b><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"color: rgb(156, 0, 255);\">Why\nshould someone take an HIV test ?</span></span></b></span></h5><h5 class=\"MsoListParagraph\" style=\" margin: 0in 0in 6pt 27pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[endif]--></h5><ul><li><h5 class=\"MsoListParagraphCxSpFirst\" style=\" margin: 0in 0in 6pt 27pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"font-size: 10pt;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">\n</span></span><span style=\"font-weight: normal;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">For some people taking\nthe HIV test can be a scary decision. <br></span></span></span></span></h5></li></ul><ul><li><h5 class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in 0in 6pt 27pt; text-align: left; text-indent: -0.25in; line-height: 2;\"><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span></span><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"font-weight: normal;\">  Some people get tested\nevery six months, even if they practice safer sex. No matter what the reasons\nare, taking the HIV test can be a good idea. </span><br></span></span></span></h5></li></ul><ul><li><h5 class=\"MsoListParagraphCxSpMiddle\" style=\" margin: 0in 0in 6pt 27pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">\n</span></span><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">   <span style=\"font-weight: normal;\"> Sometimes taking the test\nis a way to make a new found commitment towards safer practices. </span><br></span></span></span></h5></li></ul><ul><li><h5 class=\"MsoListParagraphCxSpMiddle\" style=\" margin: 0in 0in 6pt 27pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">\n</span></span><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">  <span style=\"font-weight: normal;\">  It is important to\nremember that</span> <span style=\"font-weight: normal;\">getting tested for HIV will not change the HIV status.</span></span></span></span></h5></li></ul><h5 style=\" line-height: 2;\">\n\n\n\n\n\n\n\n\n\n\n\n\n\n</h5><ul><li><h5 class=\"MsoListParagraphCxSpLast\" style=\" margin: 0in 0in 6pt 27pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">\n</span></span><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">  <span style=\"font-weight: normal;\">  It just tells whether or\nnot someone has the</span> <span style=\"font-weight: normal;\">HIV infection and</span> <span style=\"font-weight: normal;\">can avail treatment facilities</span><span style=\"font-weight: normal;\"></span> <span style=\"font-weight: normal;\">at the\nearliest</span>.</span></span></span></h5></li></ul><h5 class=\"MsoListParagraphCxSpLast\" style=\" margin: 0in 0in 6pt 27pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"font-weight: normal;\"><span style=\"color: rgb(0, 0, 0);\"> </span></span><o:p></o:p></span></span><!--[endif]--></h5>','','<p style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(156, 0, 255); font-weight: bold;\">विंडो पीरियड क्या है ?</span></span></p><p style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(156, 0, 255); font-weight: bold;\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span></span><span style=\"color: rgb(156, 0, 255);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span><span style=\"color: rgb(0, 0, 0);\">विंडो पीरियड एच.आई.वी. संक्रमण हो जाने के बाद से 6 का वह समय होता है जिसमें एच.आई.वी. के विषाणु शरीर में मौजूद होते हुए भी जाॅच के बावजूद भी पहचान में नहीं आते है। इस दौराना जाॅच करवाने से परिणाम सही नहीं आता है।</span></span></span></p><p style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(156, 0, 255); font-weight: bold;\">एच.आई.वी. की जाॅच क्यों करवायें ?</span></span></p><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">कुछ लोग एच.आई.वी. की जाॅच करवाने से डरते है और कुछ</span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"> लोग सुरक्षित यौन क्रिया के बावजूद भी हर 6 महीने में एच.आई.वी. की जाॅच करवाते रहते है। समय पर जाॅच कराना सुरक्षित यौन सम्बन्धों की ओर पतिबद्धता को बढ़ावा देता है। एच.आई.वी. की जाॅच करवाने से कोई पाॅजीटिव नहीं होता है। इससे एच.आई.वी. की स्थिति का पता लगता है और</span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"> इलाज या उपचार जल्द शुरू किया जा सकता है। जाॅच का परिणाम पत्र जाॅच केन्द्र से प्राप्त करना अनिवार्य है। नतीजा जो भी हो, जाॅच के उपरांत परामर्श लेना बहुत ही अनिवार्य है। <br></span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">इस एप्लिकेशन के द्वारा जाॅच के तथ्यों पर व परामर्श पर जानकारी बढ़ाने के लिए सलाहकार व डाॅक्टर से सम्पर्क किया जा सकता है। जो कि बिल्कुल निःशुल्क है।</span></span></li></ul><p style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><br></span></p>','','N'),(22,4,'<p class=\"MsoNormal\" style=\"margin-bottom: 6pt; text-align: justify; line-height: 2;\"><span style=\"color: rgb(156, 0, 255);\"><b><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">    <span style=\"font-family: Arial Black;\">    How can someone protect\nfrom getting HIV infection? <br></span></span></b></span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin: 0in 0in 0.0001pt 27pt; text-align: justify; line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Condoms, when used consistently and correctly, are\nhighly effective in preventing sexual transmission of HIV, the virus that\ncauses AIDS. <o:p></o:p></span></span></span></p><p style=\"line-height: 2;\">\n\n\n\n</p><p class=\"MsoListParagraphCxSpLast\" style=\"margin: 0in 0in 0.0001pt 27pt; text-align: justify; line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-weight: bold;\"><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Through this application you can connect with the\ndoctor and counsellor to get detail about HIV testing and counselling. This is\ntotally free of cost.</span></span></span></span></p><p class=\"MsoListParagraphCxSpLast\" style=\"margin: 0in 0in 0.0001pt 27pt; text-align: justify; line-height: 2;\"><span style=\"font-family: Arial Black;\"><br></span></p><p class=\"MsoListParagraphCxSpLast\" style=\"margin: 0in 0in 0.0001pt 27pt; text-align: justify; line-height: 2;\"><br><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"></span></span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><o:p></o:p></span></p>','','<p style=\"line-height: 2;\"><span style=\"color: rgb(156, 0, 255); font-weight: bold;\">एच.आई.वी. से अपने आप को कैसे बचाएं ?</span></p><p style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\">हर यौन संबंध बनाने के दौरान कंडोम के प्रयोग से यौन रोग तथा एच.आई.वी. से बचा जा सकता है। इस बात का खास ध्यान रखना चाहिए कि कंडोम को सही तरीके से इस्तेमाल करने की एक विधि होती है। डबल कंडोम के इस्तेमाल से कंडोम में घर्षण होती है जिससे कंडोम फट जाता है और वीर्य का रिसाव कंडोम से बाहर होने की संभावना रहती है।</span></p><div style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\"><span id=\"result_box\" class=\"\" lang=\"hi\"><span class=\"\"><br><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-weight: bold;\">इस आवेदन के माध्यम से आप एचआईवी परीक्षण और परामर्श के बारे में विस्तार के लिए डॉक्टर और परामर्शदाता से जुड़ सकते हैं।</span></span></span><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-weight: bold;\"> <span class=\"\">यह पूरी तरह से नि: शुल्क है</span></span></span></span></span></div>','','N'),(23,4,'<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 2;\"><span style=\"font-family: Arial Black;\"><b><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"color: rgb(156, 0, 255);\">What\nis the test for HIV called ? <br></span></span></b></span></p><ul><li><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"font-size: 10pt;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span></span><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">There are three types of\ntests which tell the results of the HIV. PCR, Elisa and P24 antigen. <br></span></span></span></li></ul><ul><li><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span></span><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">The test which is\navailable free of cost in all government hospitals called the Elisa.</span></span></span></li></ul><ul><li><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span></span><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">PCR is only made free for\ninfants in selected facilities. PCR is costly because it gives the results of\nHIV within 72 hours. <br></span></span></span></li></ul><p class=\"MsoListParagraphCxSpLast\" style=\"margin: 0in 0in 12pt 27.35pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[if !supportLists]--></p><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">\n</span></span><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">P24 antigen can be\nconducted after one month if a person has been infected with HIV.<o:p></o:p></span></span></span></li></ul><p class=\"MsoListParagraphCxSpLast\" style=\"margin: 0in 0in 12pt 27.35pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><!--[endif]--></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 2;\"><span style=\"font-family: Arial Black;\"><b><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><br></span></b></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 2;\"><span style=\"font-family: Arial Black;\"><b><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"color: rgb(156, 0, 255);\">If\nsomeone is HIV Positive, what should they do?</span><o:p></o:p></span></b></span></p><ul><li><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"font-size: 10pt;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span></span><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Go to the ART Centre and\nget your CD4 count done at the ART Centre</span></span></span></li></ul><ul><li><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">If your CD4 count is less\nthan 500 then start your medicines given at the ART Centre  <br></span></span></span></li></ul><ul><li style=\"line-height: 2;\"><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span></span><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">See a healthcare\nprofessional for a complete medical check-up for HIV infection and advice on\ntreatment and health maintenance.</span></span></span></li><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Take a test for TB and other STDs. <a style=\"text-align: justify; text-indent: -0.25in; font-size: 10pt; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 10pt;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"> <br></span></span></a></span></span></span></li><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Inform sexual partner(s)\nabout their possible risk for HIV. The local health department has a partner\nnotification programme that can help.</span></span></span></li><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">   </span><span style=\"text-align: justify; text-indent: -0.25in; font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Protect others from the\nvirus by following the precautions like always using condoms and not sharing\nneedles with others.</span></span></span></span></li><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">  </span><span style=\"text-align: justify; text-indent: -0.25in; font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Protect from any\nadditional exposure to HIV.</span></span></span></span></li><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">  </span><span style=\"text-align: justify; text-indent: -0.25in; font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Avoid drug and alcohol\nuse, good nutrition, and avoid fatigue and stress.</span></span></span></span></li><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"> </span><span style=\"text-align: justify; text-indent: -0.25in; font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Find a support group of\npeople who are going through similar experiences.</span></span></span></span></li><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"> </span><span style=\"text-align: justify; text-indent: -0.25in; font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Do not donate blood,\nplasma, semen, body organs or other tissue.</span></span></span></span></li><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">   </span><span style=\"text-align: justify; text-indent: -0.25in; font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">People have a happy sex\nlife after HIV. Non-penetrative, thigh sex, kissing, mutual masturbation,\nmessage, etc. are recommended. </span><div style=\"line-height: 2;\"><!--[if !supportAnnotations]-->\n\n<div style=\"line-height: 2;\"><div id=\"_com_1\" class=\"msocomtxt\" language=\"JavaScript\" style=\"line-height: 2;\"><p class=\"MsoCommentText\" style=\"line-height: 2;\"><br></p>\n\n<!--[if !supportAnnotations]--></div>\n\n<!--[endif]--></div>\n\n</div></span></span></span></li></ul><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin: 0in 0in 6pt 27pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><span style=\"font-family: Arial Black;\"><br></span></p>','','<p><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-weight: bold;\">एच आई वी की जाँच को क्या कहते है ?</span></span></span></p><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">एच.आई.वी. के लिए 3 तरह की जाँच होती है पी.सी.आर., एलिसा और पी-24 एंटीजन।<br></span></span></li></ul><span style=\"font-family: Arial Black;\"><span style=\" color: rgb(0, 0, 0);\"></span></span><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">हर सरकारी हस्पताल में एलिसा टेस्ट मुफ्त उपलब्ध करवाया जाता है। <br></span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">अन्य जांचे काफी महँगी होती हंै।</span></span></li></ul><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span></span></span><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">कुछ जगाओ में बच्चो के लिए पी.सी.आर. टेस्ट मुफ्त होता है। पी.सी.आर. टेस्ट 72 घंटों के बाद एच.आई.वी. होने या ना होने का नतीजा बता देता है इसलिये ये काफी महंगा होता है।</span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">पी-24 एंटीजन जाॅच असुरक्षित यौन संबंध होने के एक महीने के बाद करवा सकते है।</span></span></li></ul><p><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><br></span></span></p><p><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-weight: bold;\">अगर कोई व्यक्ति एच आई वी पॉजिटिव हो तो उसको क्या करना चाहये?</span></span></span></p><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">ए.आर.टी. सेन्टर में जाकर उस व्यक्ति को अपना सी.डी. 4 काउंट की जाॅच करवानी चाहिये।</span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">अगर उसे व्यक्ति का सी.डी. 4 काउंट 500 से कम हो तो उसे ए.आर.टी. सेन्टर द्वारा दी कई दवाईओ को नियमित लेना चाहिए।</span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">अनुभवी स्वास्थ्य सेवक से अपनी पूरा जाँच करवाये और उनकी दी हुई सलाह को माने।</span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">टी.बी. और अन्य एस.टी.डी. संक्रमणों की भी जांच कराये।</span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">अपने यौन साथी को एच.आई.वी. के जोखिम के बारे में बताये। पास के किसी भी स्वास्थ्य क्षेत्र के पार्टनर नोटिफिकेशन प्रोग्राम से मदद ले।</span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">अपने साथ दूसरो को भी इसके जोखिम से बचाये जैसे की कंडोम का उपयोग करके और सुइयों को मिल बाट के न इस्तेमाल करे।</span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">अत्यन्त चिंता ना करे, ड्रग्स तथा शराब का सेवन ना करे (विशेष तौर से यौन संबंध बनाने के दौरान) तथा पौष्टिक आहार का सेवन करे। <br></span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">ऐसे व्यक्ति या सपोर्ट ग्रुप से मिले जो समान अनुभवो से गुजर रहे हो।</span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">अपना रक्त, प्लाज्मा, वीर्य या शरीर के अंगों को दान न दे।</span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">एच.आई.वी. संक्रमण के बाद भी व्यक्ति खुशहाल यौन जीवन व्यतीत कर सकते है। चुम्बन, हस्तमैथुन, मालिश, जाॅघ सेक्स जैसी प्रक्रियाओं द्वारा भी सेक्स का आनंद उठा सकते है।</span></span></li></ul><div><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><br></span></span></div>','','N'),(24,7,'<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\njustify;text-justify:inter-ideograph;line-height:normal\"><b><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"color: rgb(156, 0, 255);\">What is the law regarding same-sex activity in India? </span><o:p></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\njustify;text-justify:inter-ideograph;line-height:normal\"><b><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><o:p><br></o:p></span></b></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial Black;\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Section 377,</span><span style=\"font-size:10.0pt;mso-fareast-font-family:\nCalibri;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;\nmso-ansi-language:EN-IN\" lang=\"EN-IN\"><span style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">IPC</span>Â <span style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">reads as: <o:p></o:p></span></span></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial Black;\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Unnatural offences -”Whoever voluntarily has carnal intercourse against\nthe order of nature with any man, woman or animal, shall be punished with\nimprisonment for life, or with imprisonment of either description for a term\nwhich may extend to ten years, and shall also be liable to fine. <o:p></o:p></span></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial Black;\"><span style=\"font-size: 6pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><o:p><br></o:p></span></span></span></p><ul><li style=\"line-height: 2;\"><!--[if !supportLists]--><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial Black;\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"> Under the most recent draft Bill (Rights of the Transgender Persons\nBill, 2016), the Constitutionality of Section 377 is currently being challenged\nat the Supreme Court. However, the matter is pending. <o:p></o:p></span></span></span></li></ul><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial Black;\"><span style=\"font-size: 6pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><o:p><br></o:p></span></span></span></p><p style=\"line-height: 2;\">\n\n\n\n\n\n\n\n\n\n\n\n\n\n</p><ul><li style=\"line-height: 2;\"><!--[if !supportLists]--><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial Black;\"><span style=\"font-size:10.0pt;font-family:\" courier=\"\" new\";mso-fareast-font-family:=\"\" \"courier=\"\" new\";mso-ansi-language:en-in\"=\"\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"> </span></span></span><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"font-family: Arial Black;\">Naz Foundation (an NGO in India) along with other human rights\norganizations, parents of community members, child rights groups, all together\nhave filed a curative petition in the Supreme Court of India in 2014, which is\npending in Supreme Court. <br></span></span></span><!--[endif]--></li></ul><p><br></p>','','<p style=\"line-height: 2;\"><span style=\"color: rgb(156, 0, 255); font-weight: bold;\">भारत में समलैंगिक के संदर्भ मैं क्या कानून है ?</span></p><p style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\">आई.पी.सी. की धारा 377 यह कहता हैः अप्राकृतिक अपराधः किसी भी तरह का कामुक सम्भोग जो की अप्राकृतिक हो और किसी भी पुरुष, महिला, या जानवर के साथ किया गया हो, वह जीवन भर के कारावास या विवरण अनुसार जो की बढ़ कर दस साल तक हो की सजा, साथ ही जुर्माना भरने की सजा पा सकता है।</span></p><ul><li style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\">हाल की ड्राफ्ट याचिका में (ट्रांसजेंडर व्यक्ति के अधिकार पर लेख पत्र), धारा 377 को असंवैधानिक कह कर उच्चतम न्यायलय में चुनौती दी गई है, अभी मामला अपूर्ण है। </span></li></ul><p style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\"><br></span></p><ul><li style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\">नाज़ फाउंडेशन (एक गैर सरकारी भारत की संस्था) साथ ही मानव अधिकार संगठन, समुदाय के माता-पिता, बाल अधिकार संगठनो ने मिल कर 2014 में उच्चतम न्यायालय में एक क्यूरेटिव याचिका दर्ज की है, जो अभी अपूर्ण है।</span></li></ul><div style=\"line-height: 2;\"><br></div>','','N'),(25,7,'<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(156, 0, 255);\"><b><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">What are some important facts about the NALSA (</span></b><b><span style=\"font-size:10.0pt;mso-bidi-font-family:\nCalibri;mso-bidi-theme-font:minor-latin\">National Legal Services Authority)</span></b><b><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"> judgement? <br></span></b></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 2;\"><span style=\"font-family: Arial Black;\"><br></span></p><ul><li style=\"line-height: 2;\"><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span></span><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">The Supreme Court in 2014 said that the Transgender individuals have the\nright to decide their self-identified gender, and directed the Centre and State\ngovernments to grant legal recognition to them as male, female or third gender.</span></span></span></li></ul><ul><li style=\"line-height: 2;\"><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"mso-bidi-font-size:10.0pt;line-height:115%;mso-fareast-font-family:Calibri;\nmso-fareast-theme-font:minor-latin;mso-bidi-font-family:Calibri;mso-bidi-theme-font:\nminor-latin;mso-ansi-language:EN-IN\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">To grant quotas to transgender\npersons in educational institutions. <br></span></span></span></li></ul><ul><li style=\"line-height: 2;\"><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"mso-bidi-font-size:10.0pt;line-height:115%;mso-fareast-font-family:Calibri;\nmso-fareast-theme-font:minor-latin;mso-bidi-font-family:Calibri;mso-bidi-theme-font:\nminor-latin;mso-ansi-language:EN-IN\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">To make it not-mandatory to provide\nsex reassignment surgery papers to establish ones gender identity.</span></span></span></li></ul><ul><li style=\"line-height: 2;\"><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"mso-bidi-font-size:10.0pt;line-height:115%;mso-fareast-font-family:Calibri;\nmso-fareast-theme-font:minor-latin;mso-bidi-font-family:Calibri;mso-bidi-theme-font:\nminor-latin;mso-ansi-language:EN-IN\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">To provide medical care for\nTransgender persons in hospitals, and separate toilets.</span></span></span></li></ul><ul><li style=\"line-height: 2;\"><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">The University Grants Commission\n(UGC) introduced a notification in 2014 directing educational institutions to\nspecially provide admissions to Transgender Development Board in 2014.</span></span></span></li></ul><ul><li style=\"line-height: 2;\"><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"mso-bidi-font-size:10.0pt;line-height:115%;mso-fareast-font-family:Calibri;\nmso-fareast-theme-font:minor-latin;mso-bidi-font-family:Calibri;mso-bidi-theme-font:\nminor-latin;mso-ansi-language:EN-IN\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span></span><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">To\nframe social welfare schemes for Transgender persons.</span></span></span></li></ul><span style=\" font-family: Arial Black;\"><span style=\" color: rgb(0, 0, 0);\"><span style=\" font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"></span></span></span><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\" color: rgb(0, 0, 0);\"><span style=\" font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Chhattisgarh has announced a 2% housing quota for Transgender persons in 2015</span></span></span></li></ul><span style=\" font-family: Arial Black;\"><span style=\"  color: rgb(0, 0, 0);\"><span style=\"  font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"></span></span></span><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"> </span><span style=\"text-align: justify; text-indent: -0.25in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\">West\nBengal announced setting up of Transgender Development Board in 2015.</span><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"> <br></span></span></span></li></ul><span style=\" font-family: Arial Black;\"><span style=\" color: rgb(0, 0, 0);\"><span style=\" font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span></span></span><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"text-align: justify; text-indent: -0.25in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\">Kerala\nreleased the ‘State Policy’ for Transgender persons in 2015. The policy affirms\nthe right to self-identification, equal access to education and freedom from\nviolence for Transgender persons in 2015. <br></span></span></span></li></ul><span style=\" font-family: Arial Black;\"><span style=\" color: rgb(0, 0, 0);\"><span style=\" text-align: justify; text-indent: -0.25in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 10pt; line-height: 115%;\" lang=\"EN-IN\"></span></span></span><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">Maharashtra\nannounced setting up of Transgender Development Board in 2014.</span></span></li></ul><span style=\" font-family: Arial Black;\"><span style=\" color: rgb(0, 0, 0);\"></span></span><ul><li style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">The\nReserve Bank of India directed all banks to introduce “third gender” in all\nforms and applications in 2015.</span></span></li></ul><span style=\" font-family: Arial Black;\"><span style=\" color: rgb(0, 0, 0);\"><br></span></span>','','<p class=\"MsoNormalCxSpFirst\" style=\"margin-left:-7.1pt;mso-add-space:auto;\ntext-align:justify;text-indent:7.1pt;line-height:normal\"><span style=\"font-family: Arial Black;\"><span style=\"font-weight: bold;\"><span style=\"color: rgb(156, 0, 255);\"><br></span></span></span></p><p class=\"MsoNormalCxSpFirst\" style=\"margin-left:-7.1pt;mso-add-space:auto;\ntext-align:justify;text-indent:7.1pt;line-height:normal\"><span style=\"font-family: Arial Black;\"><span style=\"font-weight: bold;\"><span style=\"color: rgb(156, 0, 255);\">नालसा (नेशनल लीगल सर्विसेस अथोरिटी) के 10 तथ्य <br></span></span></span></p><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">उच्चतम न्यायालय द्वारा 2014 में कहा गया कि ट्रांसजेंडर व्यक्ति को यह अधिकार है कि वह अपने लिंग की स्वयं पहचान कर सकता हैए और निर्देश अनुसार केंद्रीय व राज्य सरकारों को कहा गया की वह इन्हें पुरुषए महिला या तीसरे लिंग की कानूनी मान्यता दे।</span></span></li></ul><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span></span></span><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">ट्रांसजेंडर व्यक्ति को शैक्षणिक संस्थानों में आरक्षण दे।</span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">किसी के भी लिंग पहचान के लिए उसके लिंग परिवर्तन सर्जरी के दस्तावेजो की मांग को अनिवार्य नहीं किया गया।</span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">हस्पतालो में ट्रांसजेंडर व्यक्ति के स्वास्थ्य के लिए चिक्तिसक सुविधा दी जाये साथ ही उनके लिए अलग शौचालय बनाया जाये। <br></span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">ट्रांसजेंडर व्यक्तियों के लिए सामाजिक विकास का ढांचा तयार करंे। <br></span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">छत्तीसगढ़ ने ट्रांसजेंडर व्यक्तियो के लिए २ः आवास योजना की घोषणा 2015 में करी।</span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">पश्चिम बंगाल ने ट्रांसजेंडर विकास बोर्ड के निर्माण कि स्थापना 2005 में घोषित करी। <br></span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">केरल ने 2015 में ट्रांसजेंडर व्यक्तियों के लिए ;राज्य नीतिद्ध कि घोषणा करीए इस नीति के अनुसार स्वयं के लिंग की पहचान सुनिश्चित कि जाती हैए 2015 में यह भी सुनिश्चित किया गया कि ट्रांसजेंडर व्यक्ति को सामान शिक्षा का अधिकार है और उन्हें हिंसायुक्त जीवन जीने का अधिकार है। <br></span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">महाराष्ट्र ने ट्रांसजेंडर विकास बोर्ड के गठन की स्थापना 2005 में घोषित करी। <br></span></span></li></ul><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">2015 में रिजर्व बैंक ऑफ इंडिया ने अपने सभी बैंको को ष्थर्ड जेंडरष् को अपने आवेदन में जोड़ने का निर्देश दिया।</span></span></li></ul><div style=\"text-align: justify; text-indent: 9.46667px; line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><br></span></span></div><div style=\"text-align: justify; text-indent: 9.46667px; line-height: 2;\"><span style=\"font-family: Arial Black;\"><br></span></div>','','N'),(26,7,'<p class=\"MsoNormalCxSpFirst\" style=\"margin-left: -7.1pt; text-align: justify; text-indent: 7.1pt; line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(156, 0, 255);\"><b><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Is Sex Worker legal </span></b></span><b><span style=\"font-size:10.0pt;mso-fareast-font-family:Calibri;mso-bidi-font-family:\nCalibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:EN-IN\" lang=\"EN-IN\"><span style=\"color: rgb(156, 0, 255);\">in India? </span><o:p></o:p></span></b></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"color: rgb(0, 0, 0);\">Solicited sex is criminalized and is illegal in India. Due to these\nadolescent/young sex workers are vulnerable to arrest and harassment. </span><o:p></o:p></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 2;\"><span style=\"font-family: Arial Black;\"><b><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><o:p> </o:p></span></b></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 2;\"><span style=\"font-family: Arial Black;\"><b><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"color: rgb(156, 0, 255);\">Do Transgender have legal recognition in India? </span><br></span></b></span></p><ul><li><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"font-size:10.0pt;font-family:\" courier=\"\" new\";mso-fareast-font-family:=\"\" \"courier=\"\" new\";mso-ansi-language:en-in\"=\"\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span></span><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Transgender populations are now being legally announced as ‘third\ngender’ by Supreme Court of India in 2014, which provides them with legal and\nsocial recognition and <br></span></span></span></li></ul><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-bottom: 0.0001pt; text-align: justify; text-indent: -0.25in; line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\"><br><span style=\"font-family: Arial Black;\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><o:p></o:p></span></span></span><!--[endif]--></p><p style=\"line-height: 2;\">\n\n\n\n\n\n\n\n\n\n</p><ul><li><!--[if !supportLists]--><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial Black;\">Entitlements to support their needs. However, MSMs and sex workers do\nnot have any legal recognition. </span></span><o:p></o:p></span></li></ul>','','<p style=\"line-height: 2;\"><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-weight: bold;\">क्या भारत में देह व्यापार कानूनी है ? </span></span></p><p style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\">भारत में यौन संबंधों के लिये आग्रह करना गैर कानूनी है। जिसके वजह से किशोर/युवा यौन कर्मियों को गिरफ्तारी और उत्पीड़न का खतरा रहता है।</span></p><p style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\"><br></span></p><p style=\"line-height: 2;\"><span style=\"font-weight: bold;\"><span style=\"color: rgb(156, 0, 255);\">क्या ट्रांसजेंडर व्यक्ति को भारत में कानूनी मान्यता है ? <br></span></span></p><ul><li><span style=\"color: rgb(0, 0, 0);\">2014 में उच्चतम न्यायालय ने ट्रांसजेंडर समुदाय को कानूनी रूप से ‘थर्ड जेंडर‘ घोषित किया है, जिसके अन्तर्गत उन्हें कानूनी और सामाजिक पहचान मिली है</span></li></ul><p style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\"><br></span></p><ul><li><span style=\"color: rgb(0, 0, 0);\"> साथ ही उनको उनकी मांगों व जरूरतों को भी मान्यता मिली है। हालांकि एमएसएम और यौन कर्मीयों को कोई कानूनी मान्यता नहीं है।</span></li></ul><div style=\"line-height: 2;\"><br></div><p style=\"line-height: 2;\"><br></p>','','N'),(27,7,'<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: center; line-height: 2;\" align=\"center\"><b style=\"color: inherit;\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"color: rgb(156, 0, 255);\">Sex Reassignment Surgery </span></span></b><span style=\"color: inherit;\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"><span style=\"color: rgb(156, 0, 255);\"> <span style=\"font-weight: bold;\">male to female</span></span></span></span><span style=\"font-weight: bold;\"><span style=\"color: rgb(156, 0, 255);\"><br></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 2;\"><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-weight: bold;\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Removal of the male genitals and reconstructed a vagina to enable the\ntransgender to perform the sexual functions of a female. It is a complex\nprocess that needs physiological and medical therapy. The person undergoing the\nsurgery is advised by the doctor to start hormonal pills to avoid any imbalance\nafter surgery. And post-surgery, they need to be constantly monitored and\ncounselled by doctor.</span><span style=\"font-size:10.0pt;mso-fareast-font-family:Calibri;mso-bidi-font-family:\nCalibri;mso-bidi-theme-font:minor-latin;mso-ansi-language:EN-IN\" lang=\"EN-IN\"> <span style=\"background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Presently, there are no medical guidelines for sex\nreassignment surgeries in India.</span></span></span><span class=\"apple-converted-space\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-weight: bold;\"> </span><br></span></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 2;\"><span style=\"color: rgb(156, 0, 255);\"><span class=\"apple-converted-space\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><br></span></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-align: justify; line-height: 2;\"><span style=\"color: rgb(156, 0, 255);\"><span class=\"apple-converted-space\"><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><iframe src=\"//www.youtube.com/embed/9z8F90jgtnM\" width=\"250\" height=\"200\" frameborder=\"0\"></iframe></span></span></span><b><span style=\"font-size: 10pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"> <span lang=\"EN-IN\"><o:p></o:p></span></span></b></p>','','<p style=\"line-height: 2;\"><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-weight: bold;\">लिंग निर्माण क्या है ?</span></span><span style=\"color: rgb(0, 0, 0);\"><br></span></p><p style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\">किसी भी ट्रांसजेंडर व्यक्ति के पुरुष लिंग को हटा कर योनि बनाना ताकि वह यौनिक रूप से महिलायो जैसी हो जाये और उस यौनि को क्रियान्वित कर सके, यह एक जटिल प्रक्रिया है जिसमे आपरेशन से पहले मनोवैज्ञानिक वा चिकित्सा संबंधी उपचार से कम से कम चार महीने गुजरना पडता है। आपरेशन से पहले व्यक्ति को डॉक्टर के निर्देश अनुसार हॉर्मोन की दवाईया खानी पड़ती है ताकि वो आपरेशन के बाद किसी असंतुलन से ना गुजरे। आप्रेशन उपरान्त भी व्यक्ति को डॉक्टर की परामर्श लेनी पड़ती है ताकि वो शरीर की रचना व शरीर के विज्ञान को समझ सके। इस समय भारत में लिंग परिवर्तन के लिए कोई मेडिकल दिशा निर्देश मौजूद नहीं है। बहुत से ट्रांसजेंडर अभी भी अपना लिंग हटवाने दाई माँ (ट्रांसजेंडर में कोई बड़ा सदस्य) या झोला छाप डॉक्टर के पास जाते है।</span></p><p style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\"><br></span></p><p style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\"><iframe src=\"//www.youtube.com/embed/9z8F90jgtnM\" width=\"250\" height=\"200\" frameborder=\"0\"></iframe><br></span></p><p style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\"><br></span></p><p style=\"line-height: 2;\"><span style=\"color: rgb(0, 0, 0);\"><br></span></p><div><br></div>','','N'),(28,6,'<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(156, 0, 255);\"><b><span style=\"font-size: 10pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">What is Stigma?</span></b></span></span></p><ul><li><!--[if !supportLists]--><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial Black;\"><span style=\"font-size: 9pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Stigma\nrefers to disapproval of a person or group on characteristics that are\ndifferent from the society on certain norms. <o:p></o:p></span></span></span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial Black;\"><span style=\"font-size: 9pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Stigma\nis understood as a negative term that often leads to discrimination of certain\ngroups from the society. <o:p></o:p></span></span></span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial Black;\"><span style=\"font-size:9.0pt;mso-bidi-font-size:\n10.0pt;line-height:115%;mso-fareast-font-family:\" times=\"\" new=\"\" roman\";mso-bidi-font-family:=\"\" calibri;mso-bidi-theme-font:minor-latin;border:none=\"\" windowtext=\"\" 1.0pt;=\"\" mso-border-alt:none=\"\" 0in;padding:0in\"=\"\">Treating a person badly because\nof how they look/behaviour/ status/negative incident is stigma<o:p></o:p></span></span></span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial Black;\"><span style=\"font-size:9.0pt;mso-bidi-font-size:\n10.0pt;line-height:115%;mso-fareast-font-family:\" times=\"\" new=\"\" roman\";mso-bidi-font-family:=\"\" calibri;mso-bidi-theme-font:minor-latin;border:none=\"\" windowtext=\"\" 1.0pt;=\"\" mso-border-alt:none=\"\" 0in;padding:0in\"=\"\">Calling someone names because\nof how they look is stigma<o:p></o:p></span></span></span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial Black;\"><span style=\"font-size:9.0pt;mso-bidi-font-size:\n10.0pt;line-height:115%;mso-fareast-font-family:\" times=\"\" new=\"\" roman\";mso-bidi-font-family:=\"\" calibri;mso-bidi-theme-font:minor-latin;border:none=\"\" windowtext=\"\" 1.0pt;=\"\" mso-border-alt:none=\"\" 0in;padding:0in\"=\"\">Gossiping, isolating or making\nfun of someone is stigma <o:p></o:p></span></span></span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial Black;\"><span style=\"font-size:9.0pt;mso-bidi-font-size:\n10.0pt;line-height:115%;mso-fareast-font-family:\" times=\"\" new=\"\" roman\";mso-bidi-font-family:=\"\" calibri;mso-bidi-theme-font:minor-latin;border:none=\"\" windowtext=\"\" 1.0pt;=\"\" mso-border-alt:none=\"\" 0in;padding:0in\"=\"\">Stigma is a process of creating\na ‘spoiled identity’ of an individual or a group of individuals. <o:p></o:p></span></span></span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial Black;\"><span style=\"font-size:9.0pt;mso-bidi-font-size:\n10.0pt;line-height:115%;mso-fareast-font-family:\" times=\"\" new=\"\" roman\";mso-bidi-font-family:=\"\" calibri;mso-bidi-theme-font:minor-latin;border:none=\"\" windowtext=\"\" 1.0pt;=\"\" mso-border-alt:none=\"\" 0in;padding:0in\"=\"\">To identify a difference in a\nperson or a group of persons (e.g. people assumed to be promiscuous and then\nmark these differences as negative).<o:p></o:p></span></span></span></li></ul><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"></span></span></span><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"></span><span style=\"text-align: justify; text-indent: -0.25in; font-size: 9pt; line-height: 115%; border: 1pt none windowtext; padding: 0in;\">Concealing facts and behaviour\nby family to hide someone who is different or living with HIV and use separate\nbed, blanket, clothes, plates, food, etc; Insult and blame for bringing shame\nto the family</span></span></span></li></ul><span style=\" font-family: Arial Black;\"><span style=\" color: rgb(0, 0, 0);\"><span style=\" text-align: justify; text-indent: -0.25in; font-size: 9pt; line-height: 115%; border: 1pt none windowtext; padding: 0in;\"></span></span></span><ul><li><span style=\" font-family: Arial Black;\"><span style=\" color: rgb(0, 0, 0);\"><span style=\" text-align: justify; text-indent: -0.25in; font-size: 9pt; line-height: 115%; border: 1pt none windowtext; padding: 0in;\">Community stop the family from attending celebrations</span></span></span></li></ul><span style=\"  font-family: Arial Black;\"><span style=\"  color: rgb(0, 0, 0);\"><span style=\"  text-align: justify; text-indent: -0.25in; font-size: 9pt; line-height: 115%; border: 1pt none windowtext; padding: 0in;\"></span></span></span><ul><li><span style=\"  font-family: Arial Black;\"><span style=\"  color: rgb(0, 0, 0);\"><span style=\"  text-align: justify; text-indent: -0.25in; font-size: 9pt; line-height: 115%; border: 1pt none windowtext; padding: 0in;\">Children living with HIV are often prevented from playing with other children or taunted and teased<br></span></span></span></li></ul><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"text-align: justify; text-indent: -0.25in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 9pt; line-height: 115%;\" lang=\"EN-IN\"></span></span></span><ul><li><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"text-align: justify; text-indent: -0.25in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 9pt; line-height: 115%;\" lang=\"EN-IN\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\"> </span><span style=\"text-indent: -0.25in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; font-size: 9pt; line-height: 115%;\" lang=\"EN-IN\">Many\ntimes, a person who is in a same sex relationship can face two types of stigma.\nExternal stigma i.e. when this person is reluctant to report abuse because they\ndo not want to be harassed by the authorities. Internal stigma i.e. when facing\nviolence in same-sex couples believes that they deserve the violence</span></span><br></span></span>\n\n<span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><b><span style=\"font-size: 9pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\"></span></b></span></span></li></ul><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><br><b><span style=\"font-size: 9pt; line-height: 115%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\" lang=\"EN-IN\">Unaddressed\nstigma is a form of abuse which leads to low self-esteem and other\npsychological problems.</span></b></span></span><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:22.5pt;mso-add-space:\nauto;text-align:justify;text-justify:inter-ideograph;text-indent:-.25in;\nmso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial Black;\"><span style=\"font-size: 9pt; line-height: 115%; border: 1pt none windowtext; padding: 0in;\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">\n</span></span></span></span></p>','','<p><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-weight: bold;\">कलंक (स्टिगमा)</span></span></p><ul><li><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span><span style=\"color: rgb(0, 0, 0);\">कुछ लोग जो मुख्य प्रचलित परम्पराओ से अलग हो और उनकी विशेषताएं भी अलग लगे तो, समाज या समुदाय उनको कलंक (स्टिगमा) के रूप में देखता है।</span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>कलंक (स्टिगमा) को नकारात्मक शब्द समझा जाता है जिसकी वजह से कुछ समुदाय के लोगो को भेदभाव का अनुभव करना पड़ता है।</span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>किसी भी व्यक्ति से उसके रूप/स्वभाव/स्थिति/या घटे हुऐ किसी बुरे हादसे के लिए उससे र्दुव्यवहार करना भी कलंक (स्टिगमा) है। </span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>किसी के रूप या पहनावे की वजह से आपत्तिजनक नामो से बुलाना भी कलंक (स्टिगमा) है।</span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>किसी को निष्काषित या उनके बारे में बातें बनाना भी कलंक (स्टिगमा) है।</span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>किसी भी व्यक्ति या समुदाय को बदनाम करना या उसका दुरप्रचार करना भी कलंक (स्टिगमा) है।</span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>किसी भी व्यक्ति और समुदाय के बीच में भेदभाव करना कलंक है। (उदाहरण स्वरुपः लोग अक्सर सोचते है कि कोई व्यक्ति अगर एक से ज्यादा लोगों के साथ सम्बन्ध रख रहा है तो उससे नकारात्मक व्यव्हार करते है)</span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>वो व्यक्ति जो एच.आई.वी. से संक्रमित है, उसका परिवार उसकी एच.आई.वी. की स्थिति को छुपाता है और जबरन उसको रहन सहन में बदलाव करवाता है जैसे कि उसको अलग बिस्तर में सुलाना, अलग बर्तन में खाना खिलाना आदि।</span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>अपने परिवार में कलंक (स्टिगमा) और शर्मिंदगी के लिए उस पर आरोप लगाना।</span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>पारिवारिक उत्सवों या समारोहों में आमंत्रित नहीं करना।</span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>एच.आई.वी. संक्रमित बच्चों के साथ ना खेलने देना, उन बच्चों को ताना मारना, उनका मजाक उड़ाना भी कलंक (स्टिगमा) है। </span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>अक्सर सामान लिंग के साथ सम्बन्ध (समलैंगिक) रखने वाले लोगो को दुगने कलंक से गुजरना या सहना पड़ता है। बाहरी कलंक जिसकी वजह से पीड़ित व्यक्ति यंहा अपनी कोई कारवाही नहीं चाहता क्योंकि शिकायत दर्ज करने से उसे और शोषण का सामना करना पड़ सकता है। अंदरूनी कलंक (स्टिगमा) वे है जिसमें की व्यक्तियह भाव रखता है कि क्योंकि वो समलैंगिक संबंध में है इसलिए वह अपने साथी से हिंसा का हकदार है।</span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>लगातार खुदखुशी करने का विचार लाना।</span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\"><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>मामूली बातों पर घबरा जाना/अत्यधिक चिंता करना।</span></li></ul><ul><li><span style=\"color: rgb(0, 0, 0);\">लम्बे समय तक कलंक को सहते रहना शोषण का एक रूप है। यदि इसकी तरफ ध्यान ना दिया जाएं तो व्यक्ति का आत्म सम्मान कम हो जाता है एवं अन्य प्रकार की मनोवैज्ञानिक समस्याएं हो सकती है।</span></li></ul><div><ul><li><span style=\"color: rgb(0, 0, 0);\">हमेशा दुविधा में पड़े रहना या सही से सोचने या ध्यान देने में असमर्थ होना।</span></li></ul></div><div><br></div>','','N'),(29,6,'<p class=\"gmail-p1\" style=\"text-align: justify; line-height: 2;\"><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-family: Arial Black;\"><b><span style=\"font-size:10.0pt;font-family:\n\" calibri\",\"sans-serif\";mso-ascii-theme-font:minor-latin;mso-fareast-font-family:=\"\" \"times=\"\" new=\"\" roman\";mso-hansi-theme-font:minor-latin;mso-bidi-font-family:calibri;=\"\" mso-bidi-theme-font:minor-latin;border:none=\"\" windowtext=\"\" 1.0pt;mso-border-alt:=\"\" none=\"\" 0in;padding:0in;mso-ansi-language:en-us;mso-fareast-language:=\"\" en-us\"=\"\">It is important to understand that it is absolutely normal to experience\nanxiety or depression. One should talk to medical professionals and counselors\nabout these symptoms. This would help them to continue a quality life. <br></span></b></span></span></p><ul><li style=\"line-height: 2;\"><!--[if !supportLists]--><span style=\"font-family: Arial Black;\"><span style=\"font-size:10.0pt;line-height:115%;font-family:\" courier=\"\" new\";mso-fareast-font-family:=\"\" \"courier=\"\" new\";border:none=\"\" windowtext=\"\" 1.0pt;mso-border-alt:none=\"\" 0in;=\"\" padding:0in\"=\"\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">\n</span></span><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size:10.0pt;line-height:115%;\nmso-fareast-font-family:\" times=\"\" new=\"\" roman\";mso-bidi-font-family:calibri;=\"\" mso-bidi-theme-font:minor-latin;border:none=\"\" windowtext=\"\" 1.0pt;mso-border-alt:=\"\" none=\"\" 0in;padding:0in\"=\"\">India has a national network of people living\nwith HIV/AIDS. <br></span></span></span></li></ul><ul><li style=\"line-height: 2;\"><!--[if !supportLists]--><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial Black;\"><span style=\"font-size:10.0pt;line-height:115%;font-family:\" courier=\"\" new\";mso-fareast-font-family:=\"\" \"courier=\"\" new\";border:none=\"\" windowtext=\"\" 1.0pt;mso-border-alt:none=\"\" 0in;=\"\" padding:0in\"=\"\"><span style=\"font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">\n</span></span><span style=\"font-size:10.0pt;line-height:115%;\nmso-fareast-font-family:\" times=\"\" new=\"\" roman\";mso-bidi-font-family:calibri;=\"\" mso-bidi-theme-font:minor-latin;border:none=\"\" windowtext=\"\" 1.0pt;mso-border-alt:=\"\" none=\"\" 0in;padding:0in\"=\"\">This network is made up of locally-based\ngroups of people living with HIV and LGBT community. <br></span></span></span></li></ul><ul><li style=\"line-height: 2;\"><!--[if !supportLists]--><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial Black;\"><span style=\"font-size:10.0pt;line-height:115%;\nmso-fareast-font-family:\" times=\"\" new=\"\" roman\";mso-bidi-font-family:calibri;=\"\" mso-bidi-theme-font:minor-latin;border:none=\"\" windowtext=\"\" 1.0pt;mso-border-alt:=\"\" none=\"\" 0in;padding:0in\"=\"\">Make contact with these groups and networks as\nthey can help by taking sessions on stigma and support in getting HIV/STI tests\ndone. <br></span></span></span></li></ul><ul><li style=\"line-height: 2;\"><!--[if !supportLists]--><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-family: Arial Black;\"><span style=\"font-size:10.0pt;line-height:115%;\nmso-fareast-font-family:\" times=\"\" new=\"\" roman\";mso-bidi-font-family:calibri;=\"\" mso-bidi-theme-font:minor-latin;border:none=\"\" windowtext=\"\" 1.0pt;mso-border-alt:=\"\" none=\"\" 0in;padding:0in\"=\"\">They know a lot about HIV/AIDS and related\nstigma and can support individuals in self-disclosure of their sexual\norientation, which results in lower depression levels.</span></span></span></li></ul><p><span style=\"color: rgb(0, 0, 0);\"><br></span></p><p style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size:10.0pt;line-height:115%;\nmso-fareast-font-family:\" times=\"\" new=\"\" roman\";mso-bidi-font-family:calibri;=\"\" mso-bidi-theme-font:minor-latin;border:none=\"\" windowtext=\"\" 1.0pt;mso-border-alt:=\"\" none=\"\" 0in;padding:0in\"=\"\">You can get information from our experts it\nyou need any question about stigma and discrimnation.</span></span></span></p><p style=\"line-height: 2;\"><br></p><h5><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">Following are the links for short- coming out movies</span></span></h5><h5><span style=\"font-family:\"Mangal\",\"serif\"\" lang=\"HI\"></span><span style=\"font-weight: normal;\"><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-family: Arial Black;\">Aditya Shankar, Gay</span></span></span></h5><p style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size:10.0pt;line-height:115%;\nmso-fareast-font-family:\" times=\"\" new=\"\" roman\";mso-bidi-font-family:calibri;=\"\" mso-bidi-theme-font:minor-latin;border:none=\"\" windowtext=\"\" 1.0pt;mso-border-alt:=\"\" none=\"\" 0in;padding:0in\"=\"\"><iframe src=\"//www.youtube.com/embed/LeELTlbjerU\" width=\"250\" height=\"200\" frameborder=\"0\"></iframe><br></span></span></span></p><p style=\"line-height: 2;\"><br></p><h5><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(156, 0, 255);\">Shivali’s story, Transgender</span></span></h5><p style=\"line-height: 2;\"><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span style=\"font-size:10.0pt;line-height:115%;\nmso-fareast-font-family:\" times=\"\" new=\"\" roman\";mso-bidi-font-family:calibri;=\"\" mso-bidi-theme-font:minor-latin;border:none=\"\" windowtext=\"\" 1.0pt;mso-border-alt:=\"\" none=\"\" 0in;padding:0in\"=\"\"><iframe src=\"//www.youtube.com/embed/Oei7byPKVXY\" width=\"250\" height=\"200\" frameborder=\"0\"></iframe><br></span></span></span></p><p><br></p><br><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p>','','<p style=\"line-height: 2;\"><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-weight: bold;\">ये जानना बहुत जरूरी हैं कि चिंता या उदासी को महसूस करना बहुत ही आम हैं। किसी भी व्यक्ति को, जो इन लक्षणों से गुजर रहा हैं उसको किसी चिकित्सक या सलाहकार से जरूर बात करनी चाहिये। ये आपको इन लक्षणों से उभरने में मदद करंेगे और आपको गुणवतापूर्वक जीवन जीने में मदद करेंगे। इस एप्लिकेशन के माध्यम से आप डाॅक्टर या सलाहकार से सम्पर्क कर सकते है। आपके द्वारा दी गयी जानकारी को यथासंभव गोपनीय रखा जायेगा।</span></span></p><ul><li><span style=\"color: rgb(0, 0, 0);\">भारत में एच.आई.वी./एड्स के साथ जी रहे लोगांे के एवं एल.जी.बी.टी. समुदाय राष्ट्रीय स्तर पर समूह हैं। <br></span></li></ul><span style=\"color: rgb(0, 0, 0);\"><br></span><ul><li><span style=\"color: rgb(0, 0, 0);\">यह समूह स्थानीय स्तर पर आधारित एच.आई.वी. एवं एल.जी.बी.टी. का व्यक्तियों को मिलाकर बनाएं गए है। <br></span></li></ul><span style=\"color: rgb(0, 0, 0);\"><br></span><ul><li><span style=\"color: rgb(0, 0, 0);\">इस समूह से संपर्क करने से आपको एच.आई.वी. की जाच करने में साथ ही इस कलंक से उभरने में मदद मिलेगी। <br></span></li></ul><span style=\"color: rgb(0, 0, 0);\"><br></span><ul><li><span style=\"color: rgb(0, 0, 0);\">यह समूह एच.आई.वी./एड्स और एल.जी.बी.टी. उससे जुड़े कलंक के बारे में बहुत जानकारी रखते हैं और आपके लैंगिक रुझान को समझने और उसका खुलासा करने में मदद कर सकते हैं।</span></li></ul><h5><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\"><span id=\"result_box\" class=\"short_text\" lang=\"hi\"><span class=\"\">लघु फिल्में आने के लिए लिंक दिए गए हैं</span></span></span></span></h5><h5><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-family: Arial Black;\"><span style=\"font-weight: bold;\"><span id=\"result_box\" class=\"short_text\" lang=\"hi\"><span class=\"\">आदित्य शंकर, समलैंगिक</span></span></span></span></span><br><iframe src=\"//www.youtube.com/embed/LeELTlbjerU\" width=\"250\" height=\"200\" frameborder=\"0\"></iframe></h5><br><h5><span style=\"font-weight: bold;\"><span style=\"font-weight: normal;\"><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-family: Arial Black;\"><span id=\"result_box\" class=\"short_text\" lang=\"hi\"><span title=\"शिवली’स स्टोरी, ट्रांसजेंडर\">शिवली’स स्टोरी, ट्रांसजेंडर</span></span></span></span></span></span></h5><p><iframe src=\"//www.youtube.com/embed/Oei7byPKVXY\" width=\"250\" height=\"200\" frameborder=\"0\"></iframe><br></p><span style=\" color: rgb(0, 0, 0);\"><br></span><br>','','N'),(30,5,'<br><br><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-family: Arial Black;\"><span style=\"font-weight: bold;\">Correct condom use tutorial</span></span></span><br><br><iframe src=\"//www.youtube.com/embed/Hgha0C3uH4E\" width=\"250\" height=\"200\" frameborder=\"0\"></iframe><p><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-family: Arial Black;\"><span style=\"font-weight: bold;\"><br></span></span></span></p><p><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-family: Arial Black;\"><span style=\"font-weight: bold;\"><br></span></span></span></p><p><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-family: Arial Black;\"><span style=\"font-weight: bold;\"><br></span></span></span></p>','','<br><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-weight: bold;\"><span id=\"result_box\" class=\"short_text\" lang=\"hi\"><span class=\"\">सही कंडोम उपयोग ट्यूटोरियल</span></span></span></span><br><br><iframe src=\"//www.youtube.com/embed/Hgha0C3uH4E\" width=\"250\" height=\"200\" frameborder=\"0\"></iframe><p><br></p><p><br></p><p><br></p><p><br></p>','','N'),(31,0,'','','','','Y'),(32,0,'','','','','Y'),(33,0,'','','','','Y'),(34,0,'','','','','Y'),(35,6,'<h5><span style=\"font-family: Arial Black;\"><span style=\"color: rgb(0, 0, 0);\">Following are the links for short- coming out movies:</span></span></h5><h5><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-family: Arial Black;\">Fida Khan, Transgender, More young people oriented</span></span></h5><p><br><iframe src=\"//www.youtube.com/embed/shUCKTaSUSY\" width=\"250\" height=\"200\" frameborder=\"0\"></iframe></p><p><br></p><h5><span style=\"font-weight: normal;\"><span style=\"color: rgb(156, 0, 255);\"><span style=\"font-family: Arial Black;\">Divyaroop, Gay</span></span></span></h5><p