) ENGINE=InnoDB AUTO_INCREMENT=126 DEFAULT CHARSET=latin1;

/*Data for the table `tbl_message` */

insert  into `tbl_message` values (1,'expert',447,0,'what is gender identity disorder',23,'Gender Identity Disorder is also known as Gender Dysphoria. People who have gender dysphoria feel strongly that their gender does not match their biology.\r\n\r\nFor example, a person who has a penis and all other physical traits of a male might feel instead that he is actually a female. That person would have an intense desire to have a female body and to be accepted by others as a female. Or someone with the physical characteristics of a female would feel her true identity is male.\r\n\r\nFeeling that your body does not reflect your true gender can cause severe distress, anxiety, and depression. \"Dysphoria\" is a feeling of dissatisfaction, anxiety, and restlessness. With gender dysphoria, the discomfort with your male or female body can be so intense that it can interfere with your normal life, for instance at school or work or during social activities.\r\n\r\n','Y','2017-10-13 13:28:24','N'),(2,'expert',448,0,'if a person is having sex without any precaution with a negative person then is there any chance of hiv?',27,'Negative status can only be confirmed only after testing. It is advisable to use safer sex practices even with negative partners unless its a completely monogamous relationship. That is sex with only 1 partner through out life which is applicable to both the partners.','Y','2017-10-13 13:31:06','N'),(3,'expert',452,0,'what is gay',27,'Gay is a Identity among Men who get attracted towards other men sexually and are usually educated.','Y','2017-10-13 14:25:49','N'),(4,'expert',453,0,'what is sex?',27,'Sex is a process where an individual/individuals experience physical touch with one person/ group of persons for pleasure or procreation. Sex can also be painful/abusive if it not with consent.','Y','2017-10-13 14:48:41','N'),(5,'expert',445,0,'dabal condom use kar sakhta ha Kya sex karta time',23,'Sex karte waqt, double condom ka istemaal nahi karna chaiye. Double condom ka istemaal, condom fatne aur slip hone ke risk ko bada deta hai. Isiliye ek baar me sirf ek hi condom istemaal karna chaiye','Y','2017-10-13 22:36:02','N'),(6,'expert',445,0,'halo sir Mara abi Taj koye reply nehi aaya ha',23,'Replied :)','Y','2017-10-14 21:32:35','N'),(7,'expert',483,0,'plz tell me about my gender',27,'Gender is what you feel internally and want to express. It can be different that the biological sex you are born with. Your gender can only be decided by you based on what you feel and experience.  ','Y','2017-10-15 14:17:05','N'),(8,'expert',484,0,'When gay prid',27,'Delhi Queer pride is on 12th November 2017','Y','2017-10-16 14:42:11','N'),(9,'expert',484,0,'When the Gay prid in delhi 2017',27,'Delhi Queer pride is on 12th November 2017','Y','2017-10-16 14:42:51','N'),(10,'expert',485,0,'hiv kaise phalta h or is ka kya lakshn hote h',23,'HIV phelne k karan hain:\r\n1. HIV positive vyakti k saath bina condom k istemaal se sex karne se.\r\n2. HIV positive maa se delivery k waqt uske bache ko.\r\n3. HIV sankramit syringe k istemaal se.\r\n4. HIV sankramit khoon ko chadwaane se.\r\n\r\nHIV infection k koi bhi special lakshan nahi hote. Suruaat me is infection me flue jaise lakshan hote hain. Kuch dino baad,  koi bhi lakshan nahi hote. lekin jab infection badh jaata hai tab kafi saari bimariyan hoti hain, lamba bhukhaar rehta hai, wajan kam ho jaata hai aur dast bhi lag jaate hain. Anya sabhi bimariyan bhi jaldi hone lagti hain.\r\n','Y','2017-10-16 14:47:18','N'),(11,'expert',466,0,'I m gay',23,'Its ok to be gay. Its just your orientation. Its perfectly fine to be attracted towards a person of the same sex','Y','2017-10-16 17:07:33','N'),(12,'expert',504,0,'sti kin karan se felta h or iska pata hame kaise lagega',23,'Sti ka matlab hota hai yaun rog. ye bimariyaan asurakshit yaun/ sex se hoti hai. \r\nSTI ka pata janch karaane se lagta hai. doctor kuch lakshan dekh kar aur kuch jaanchein karwa kar sti ka pata laga sakta hai.','Y','2017-10-16 17:51:45','N'),(13,'expert',483,0,'kya kiss krne se HIV Ho skta h',23,'Social kiss karne se HIV nahi hota hai.\r\nLekin deep smooch karne se (jab mooh me se khoon jaa raha ho ) chances hote hain. Lekin ye chances bhi kaaafi kam hain. Toh practically kiss karne se HIV nahi ho skta.','Y','2017-10-17 14:20:12','N'),(14,'expert',505,0,'what is srs',27,'SRS is sex reassignment surgery ;it is a cosmetic operation through which a person can change genitals into the opposite sex genital. This is completely a cosmetic operation and will not give reproductive ability. This is a complex process and requires physiological and medical therapy.','Y','2017-10-17 14:26:05','N'),(15,'expert',506,0,'what is transmen',23,'A trans man is a man who was assigned female at birth. He may  undergo hormonal and surgical interventions (transexual man) or may not (transgender man)','Y','2017-10-17 14:55:23','N'),(16,'expert',512,0,'kya ap ye bta sakte h ki sti k time agar bf sex krne ki zid kre toh uske sath kre ya nhi',27,'Agar STI hua ho, Kosis yeh karen safer sex karen. Is ke saath yeh bhi zaruri hai ki partner ki bhi jaach ho taki agar STI un mai bhi phail chuka ho to treatment kiya ja sake. Condom ke sath sex bahut zaruri hai.','Y','2017-10-18 13:09:55','N'),(17,'expert',505,0,'agar hum srs bnwate h or hum sex krte h toh kya hum bhi choot sakte or agar ha toh kse niklega hmara spump',27,'SRS ke dauran, Ling ko yauni main badal diya jata hai.Yeh ek cosmetic surgery hota hai . Is prakriya main andkosh ko nikal diya jata hai tak yaunang youni jaise dikhe. Andkosh nikalne ke baad sperm nehi nikal sakta.','Y','2017-10-18 13:11:50','N'),(18,'expert',515,0,'mjhe makeup krne m koi intrest nhi h but mjhe mard hi psnd ate h toh m apne app ko kya manu',27,'Make up karna ya na karna aap ke neeji ochaayo par nirbhar karta hai. Yeh bilkul bhi jaruri nehi hai ki har vakti jise purush aache lagte ho use makeup karna hi parega. Yeh aap ke upar nirbhar karta hai ki aap kya feel karte ho.aap apne aap ko Gay /kothi /Double decker mai se jo aap ko upukt lage maan sakte ho. Agar aap Mahilao ke taraf bhi akarshit hote ho to aap apne aap ko bisexual bhi maan sakte ho.','Y','2017-10-18 16:54:05','N'),(19,'expert',505,0,'agar srs bnwa le or sex ke doran hmara sperm nhi niklega toh Humari body m garmi paida Ho skti h hum pagal ya Mar bhi skte h',27,'SRS sirf ling parivartan ki prakriya nehi hai. Is main Psychiatric therapy, voice modulation, hormonal therapy and body reconstruction bhi samil hai. Sperm andkosh(testis ) main banta hai , jo ki SRS operation ke dauran nikal diya jata hai. Is liye SRS ka baad sperm banta hi nehi hai. App mai \"Knowledge Center -> Legal rights ->Sex reassignment surgery \" mai ek video diya hua hai jis mai SRS dwara ling ko youni mai badalte hue dikhaya gaya hai.  ','Y','2017-10-19 23:26:01','N'),(20,'expert',517,0,'what is who?',27,'The World Health Organization (WHO) is a specialized agency of the United Nations that is concerned with international public health. It was established on 7 April 1948, headquartered in Geneva, Switzerland.Its current priorities include communicable diseases, in particular HIV/AIDS, Ebola, malaria and tuberculosis; the mitigation of the effects of non-communicable diseases; sexual and reproductive health, development, and ageing; nutrition, food security and healthy eating; occupational health; substance abuse; and driving the development of reporting, publications, and networking.','Y','2017-10-20 15:00:56','N'),(21,'expert',516,0,'agar keesye ka lekam par dana ha or condom sai batal dhraye tho Kya fir bi khtra ha aids ka',23,'Liqam per daan kayi karano ki wajah se ho sakta hai. ye allergy ho skti hai, ya massa ya yon rog bhi ho sakte hain. Isiliye bina condom k sex karne se aisi condition me bhi HIV hone ka khatra hai','Y','2017-10-20 22:51:30','N'),(22,'expert',534,0,'what is sti full form',23,'STI = Sexually Transmitted Infections','Y','2017-10-23 11:57:23','N'),(23,'expert',535,0,'sti kya hoti hai',23,'STI ka matlab hai sexually transmitted Infections. Inhe yaon rog bhi kehte hain. Ye asurakshit yaun sambandh se hote hain.','Y','2017-10-23 15:34:23','N'),(24,'expert',538,0,'kya kiss karne se hiv ho sakta hai',23,'kiss karne se HIV nahi hota hai.. lekin smooch karne me thoda sa risk hota hai agar mooh me ulcer ho ya bleeding ho to','Y','2017-10-24 12:52:09','N'),(25,'expert',541,0,'ager mera partner ko hiv h aur m uske sath anal sex krna chata hu bina condom ke to kiya Muje risk h.',23,'Bina condom ke sex karna, hamesha risky hota hai. Apko anal sex k liye hamesha sahi tarike se condom istemaal karna chaiye','Y','2017-10-24 18:06:13','N'),(26,'expert',538,0,'agar sar kis ke samy blud thuk ke sath andar chala jaye to dar rahta hai kya',23,'maaf kijiyega, mjhe aapka sawaal sahi se samjh nahi aaya.\r\n\r\naap agar ye puchna chahte hain ki, agar semen/ sperms thuk k saath andar le liye jaayein to kya risk hota hai?\r\nis se kafi yon rog ho skte hain. jaise ki herpes, syphilis, gonorrhoea, HIV bhi.\r\n\r\nYadi aapka koi or sawaal hai to kripiya dobara puch sakte hain.. ','Y','2017-10-24 18:07:54','N'),(27,'expert',542,0,'agar hame sti h to kya meai apne partner ke sath sex kar sakti hun mere daad h joki kafi fell gya h usse mere patnar ko koi problem to nahi hogi',23,'daad hona aur sti hona do alag alag cheezein hain. Daad fungal infection hote hain jo garmi, paseene ya shareer me kamzori hone ki wajah se bhi ho sakte hain. Sti yon rogon ko bola jata hai jo yon/ ya sex karne se ho sakte hain. \r\n\r\nDaad sex karne se nahi hote lekin shareer k touch hone se partner koo ho sakte hain yadi partner bhi kamzor hai to! \r\n\r\nbaaki yon rog asurakhshit sex karne se hi hote hain','Y','2017-10-24 21:07:24','N'),(28,'expert',545,0,'Hello mam',23,'Hi Tina,\r\nHow may I help you?','Y','2017-10-24 22:25:10','N'),(29,'expert',546,0,'Symptoms of STD???',23,'Symptoms of STD in Man:\r\n\r\n- No signs at all\r\n- Rash on the penis, testicles, or groin\r\n- Discharge (a milky white, yellow, thick or thin substance coming from the tip of the penis)\r\n- Pain with urination\r\n- Pain with ejaculation\r\n- Painful blisters on the genitals (penile spots/penile bumps)\r\n- Painless ulcer on the penis or testicles\r\n- Testicular pain and swelling\r\n- Sore throat (if engaging in oral sex)\r\n- Rectal pain, discharge, or bleeding (if engaging in receptive anal sex)','Y','2017-10-25 14:25:54','N'),(30,'expert',549,0,'what is anal warts n what is madicin Of anal warts',23,'Anal warts are small warts that can occur inside and around the anus. They start as small bumps that may be no larger than the head of a pin. Initially, they may be too small to be noticed. They can develop a cauliflower-appearance as they grow, or when several are clustered together. They may be flesh-colored, yellow, pink, or light brown.\r\n\r\nThe choice of treatment depends on the number and location of warts and patient preference. \r\n- Treatment with application of ointment (may be adequate for warts that are very small and limited to the outer area of the anus)\r\n- Surgical options may be more effective for larger warts that don’t respond to topical treatments or anal warts located inside the anal canal.\r\n- Electrocautery (An electric current is used to burn off the warts)\r\n- Laser treatments (Energy is transmitted from an intense light. This technique is often limited to use for difficult cases)','Y','2017-10-25 14:48:26','N'),(31,'expert',550,0,'sti',23,'STI means Sexually Transmitted Infections.\r\nInhe yon rog bhi kehte hain','Y','2017-10-25 15:33:09','N'),(32,'expert',539,0,'dr abhishek what is sti?',23,'Hello Monika,\r\n\r\nThanks for the question. \r\nSTI refers to Sexually Transmitted Infections. They are infections transmitted through sexual contact, caused by bacteria, viruses or parasites.','Y','2017-10-25 16:10:36','N'),(33,'expert',456,0,'kya mooh mouth me bhi gupt rog hota h',23,'haan asurakhshit oral sex karne se, mooh me bhi gupt rog ho sakta hai. jaise Herpes, gonorrhoea, HIV','Y','2017-10-25 17:56:38','N'),(34,'expert',570,0,'different off kinnar ND gay',23,'Gay or Homosexuality is a sexual orientation which denotes the attraction (sexual, erotic, romantic) of a person towards the person of same sex. While Hijra community falls under transgender umbrella. It is a socio cultural identity present in Indian Subcontinent having their own traditions. they are usually those transgenders assigned male sex at birth and living under Hijra gharaanas','Y','2017-10-25 19:06:29','N'),(35,'expert',572,0,'hy',23,'Hello,\r\n\r\nHow may I help you?\r\n','Y','2017-10-25 19:16:11','N'),(36,'expert',572,0,'which one is best brand for lubrication?',23,'Hello Devendery,\r\n\r\nI am so sorry, but we donot endorse any brand.\r\nThe best lubricant is the one which is water based and have enough lubricating capacity. Many water based KY Jellies are present in the market.','Y','2017-10-25 21:28:19','N'),(37,'expert',547,0,'mujhe  2014 me 25 December  ko pta chala ki me HIV positive  Hu. tb ye virus  meri body  me deduct  hi hua tha. lekin me ise accept  nhi kr paya or mene iska ilaaj nhi karaya tb mujhe  heja  b hua tha tb mera kafi matra  me weight  loss  ho gaya tha us ba',23,'Me aapki pareshaani samajh sakta hu. \r\nLekin aapko treatment lena chaiye... sahi treatment aur sahi samay per dawaaaiyan khana zaroori hai. Puri neend lena, acha khana khana aur tension na lena, in sab cheezon se kuch samay me Virus body me kafi kam ho jaaega, jis se aapko aur bimariyan nahi lagengi aur aapka wajan bhi badne lagega.\r\nIsiliye treatment karwana zaroori hai. Anya jankari k liye aur message karein.','Y','2017-10-26 10:52:32','N'),(38,'expert',547,0,'kuchh  esa upae  just se mera weight  bhot  Teji se bd jae or me apne aap ko suwsth  mahsush  karu',23,'Weight na badne ke kayi karan ho sakte hain:\r\n1. Koi bimari hona (Jaise TB, pet me keede, HIV, thyroid etc)\r\n2. Khaan paan sahi na hona\r\n3. Zyada stress hona aur neend sahi na hona.\r\n4. Insaan ka shareer k