sakta hai','Y','2017-10-26 21:52:16','N'),(46,'expert',591,0,'kya m apni feelings change kr skta hu',23,'Insaan apni feelings ko control kar sakta hai lekin change nahi kar sakta.\r\n\r\nLekin ye depend karta hai ki feelings kis tarah ki hai. kripyaa aap apni feelings k baaare me khul bataayein','Y','2017-10-27 11:36:25','N'),(47,'expert',592,0,'sumit Sir hlo',23,'HI','Y','2017-10-27 11:44:04','N'),(48,'expert',600,0,'hy',23,'Hi,\r\n\r\nkya Me aapki koi madad kar sakta hu?','Y','2017-10-27 12:09:49','N'),(49,'expert',608,0,'hiv ka elaj',23,'HIV ka elaj sambhav hai. HIV ki dawaaiyaa khaane se virus shareer se kafi kam ho jaata hai. lekin ye dawaaiyaaan zindagi bhar khaani padti hain','Y','2017-10-27 15:15:43','N'),(50,'expert',590,0,'agar m apna ling apne partner ke muj m du bina  condom ke to kiya muje hiv  ho skta  h ager  usse  bhi hiv h',23,'Is tarah se HIV hone k chances kafi kam hote hain. yadi doosre partner k mooh me chaale, ghaav ya khoon nikal raha ho to risk bad jata hai','Y','2017-10-27 15:53:33','N'),(51,'expert',434,0,'i want to know about hiv?',23,'HIV ek virus hai, jis se AIDS ho skta hai. HIV phelne k karan hain: 1. HIV positive vyakti k saath bina condom k istemaal se sex karne se. 2. HIV positive maa se delivery k waqt uske bache ko. 3. HIV sankramit syringe k istemaal se. 4. HIV sankramit khoon ko chadwaane se. HIV infection k koi bhi special lakshan nahi hote. Suruaat me is infection me flue jaise lakshan hote hain. Kuch dino baad, koi bhi lakshan nahi hote. lekin jab infection badh jaata hai tab kafi saari bimariyan hoti hain, lamba bhukhaar rehta hai, wajan kam ho jaata hai aur dast bhi lag jaate hain. Anya sabhi bimariyan bhi jaldi hone lagti hain.','Y','2017-10-28 14:10:15','N'),(52,'expert',626,0,'hello',23,'Hi,\r\n\r\nHow may I help you?\r\n','Y','2017-10-28 15:26:02','N'),(53,'expert',606,0,'ask me please body pain alergic and stomach infection cause in hiv.',23,'HIV brings down the immunity of a patient. It prevents the body to fight various infections that body was capable of fighting. This lead to various secondary infections in a patient which further deteriorates the immunity of the patient.\r\n\r\nRecurrent Diarrhoea is common in HIV. It compromises the nutrition status of the patient and further compromises his/her health.\r\nBody pain is not directly related to HIV. However, it is due to compromised nutrition status, weakness (developed due to infections) and destruction of virus in the body leading to exhaustion.\r\nbody becomes susceptible to various cancers and allergies too.','Y','2017-10-28 15:33:43','N'),(54,'expert',630,0,'ager hum kisi ke sath sex krte h aur discharge hone le thik pahle ager m condom pehen lu to kiya Hiv hone ka khatra reheta h',27,'Jab ling uttejit hota hai , us mai se a chipcha taral padarth nikalta hai jise \"pre cum\" kaha jata hai. Is mai bhi HIV ke visanu hote hai . Pre cum dwara bhi HIV phail sakta hai. Isi liye sex ke dwaran hamesa condom pehanna zaruri hota hai.','Y','2017-10-28 16:47:57','N'),(55,'expert',629,0,'sex karta time agar kondom pat Jayne to Kya katra ho sakta hai',23,'Sex karte waqt, condom fatne se virya, partner k gupt angon me  chala jaata hai, jis se dono partners ko yon rog/ gupt rog hone ka khatra ho jaata hai','Y','2017-10-28 16:58:04','N'),(56,'expert',456,0,'kya HIV curable h',23,'HIV abhi curable nahi hai.. lekin treatment kafi achaa maujud hai. Treatment per ek insaan puri zindagi normally guzaar sakta hai','Y','2017-10-31 13:36:35','N'),(57,'expert',606,0,'HIv program In a school',23,'Hello Arvind,\r\nCan you please elaborate your question?\r\n\r\nThere is no as such targeted activities for HIV awareness and prevention for school children. However, HIV is always discussed in books in chapters of reproductive health. ','Y','2017-11-01 01:48:11','N'),(58,'expert',639,0,'agar ak bar bina condoms sai sex kar la tho Kya hiv hona ka khtra kitna % ho sakhta ha',23,'Alag alag conditions me, Bina condom k sex karne se risk alag alag hota hai:\r\nGuda maithun/ Anal sex me\r\n1. Top partner = HIV negative, bottom partner = hiv positive\r\n- Agar top partner ka khatna (circumcision) hua hai/ top partner chilkoo hai to, bottom partner se use HIV hone ka risk 0.11% (1 in 909) hai.\r\n- Agar top partner chilkoo nahi hai to, bottom partner se use HIV hone ka khatra 0.62% hai (1 in 161)\r\n\r\n2. Top partner = HIV positive, bottom partner = HIV negative\r\n-  Agar top partner, apna virya (semen/ sperm), bottom partner k andar nahi chodta hai to, bottom partner ko HIV hone ka khatra 0.65% hai (1 in 154)\r\n- Agar top partner, apna virya (semen/ sperm), bottom partner k andar chod deta hai to, bottom partner ko HIV hone ka khatra 1.43% hai (1 in 73). Yeh risk 1.43% se 37% tak hoga agar, top partner ko haal hi me HIV infection hua ho.\r\n\r\nSTI/ Yon rog, HIV hone ka khatra badaa dete hain.\r\nPositive Partner ka treatment HIV hone ka khatra kafi kam kardeta hai','Y','2017-11-01 22:42:42','N'),(59,'expert',677,0,'why men having sex with men is it geneti or giving by neture my quetion is mr.abhishek royal',27,'There is no proven theory on homosexuality but there are few postulates which are being researched.\r\na)Genetics: The gene is already present and makes its expression .\r\nb)Pregnancy: during pregnancy, if the amniotic sac is not completely filled with amniotic fluid or the women undergoes stress or trauma.\r\nc)Environment: during childhood, the child learns through immediate environment.\r\nd)Abuse:If the child is abused \r\ne)situational: To channelize the sexual energy or as exploring with close peers.\r\nf)Learned pleasure: Taking it up as a pleasurable activity.   ','Y','2017-11-02 14:48:19','N'),(60,'expert',508,0,'hiv m  bhi  koi  lest istez hotyi hi',23,'HIV infection ki last stage ko AIDS bolte hain. \r\nLekin AIDS ka bhi treatment possible hai','Y','2017-11-03 21:17:44','N'),(61,'expert',639,0,'2 loge agar chapat baji kar rhai ho tho Kya Hiv ho sakhta ha kya',23,'Hi Simran,\r\n\r\nKripiya aap apne s