ion kafi asaani se ho jaata. In sab ki wajah se shareer aur zyada kamzor ho jaata hai.','Y','2017-11-11 12:36:42','N'),(75,'expert',755,0,'HIv aids ka body side effect kya ha',23,'HIV ka virus body ki anya bimariyo se ladne ki chamtaa ko kamzor kar deta hai, jiski wajah se us vyakti ko anya choti bimariyaa bhi aasani se hone lagti hain aur kafi ghatak roop me hone lagti hain..','Y','2017-11-11 12:37:03','N'),(76,'expert',755,0,'muja body elergy infection ha 6 month sa hua raha ha or mana Hiv test bhi karya ha report negative ha but muja kujali or dad ka problem hua raha ha koi upchar batya sir',23,'Khujli bhi kayi karano ki wajah se ho sakti hai. \r\nKayi baar kisi cheez ki wajah se allergy hone ki wajah se bhi ye khujlli ho sakti hai.\r\nKayi baaar zyada fungal infection ya daad hone ki wajah se aisa hota hai.\r\nkuch liver ki bimariyon me bhi aise lakshan paaye jaatein.\r\naur shareer me joon ho jaane ki wajah se ya khaaj ho jaane ki wajah se aisi allergy ho sakti hai.\r\nKripya doctor ko dikhaayein, taaki aapka checkup hoke sahi bimari ka pata laga k uska treatment kia jaa sake','Y','2017-11-12 12:21:57','N'),(77,'expert',755,0,'Hloo sir muja month ma 2 sa 3 bar stool ma blood ata ha ya kis baja sa ha or mana doctor ko bhi nahi batya 6 month da ya problem ha',23,'stool me blood aane k kafi reasons hote hain. \r\nAgar aapko, kabja rehti hai yaa stool tight hote hain, to uski wajah se bhi blood aa sakta hai.\r\nIn reasons ki wajah se kayi baar latrin k raaste me ghaav ho jate hain, jiski wajah se bhi blood aa sakta hai.\r\nPiles hone ki wajah se aisi shikaayat ho sakti hai. \r\nkayi baar kuch tumours ki wajah se aisa hota hai.\r\nkripya kisi general surgeon ko dikhakar apni jaanch karwaayein','Y','2017-11-13 00:45:59','N'),(78,'expert',789,0,'anal par dana ho tho Kya karna chya hiv tast karna hoga',23,'Anus pe dana hone k kaafi reasons ho sakte hain:\r\n1. Kabja hona\r\n2. latrine k raaste me lambe samay zor lagaana\r\n3. Infection ki wajah se masse hona\r\n4. anus