ex ke dwaran hamesa condom pehanna zaruri hota hai.','Y','2017-11-20 14:55:14','N'),(91,'expert',669,0,'i want know srs cling in delhi and how prossiser if i want do my srs',27,'There is no WHO recognized SRS clinic in Delhi. How ever some private clinics operate and do SRS on very high charges. ','Y','2017-11-20 17:32:01','N'),(92,'expert',904,0,'while i m having sex mera jldi se dischagre ho jata h aur thoda sa sex ki baat ho utne se h mera spream nikal jata h countinous leak hota h this is this it this normslal',27,'Sex ke dauran , ling uttejit hone se jo chipchipa padarth nekalta hai use \"Pre cum\" kehte hai. Yeh nikalna bilkul normal hai. Yeh padarth do karya karta hai a)virya ke nikelne ke raste ko saaf karta hai b) sex ke dauran lubrication pradan karta hai.\r\nPratyak waqti alag hote hai; is liye unka sex karne ke tarika bhi alag alag hota hai. Agar uttegana adhik ho to kai baar jaldi ejaculation (patan) ho jata hai aur santusti nehi mil pata. Sex ko lamba karne ke liye kuch tarike appna sakte hai a) Charam seema tak pahuch ne se pehle aapne aap ko kuch second ke liye rook le , is se us waqt uttejan kam ho jaigi aur aap kuch der aur sex kar payenge. b) PC muscles is exercise se bhi yeh waqt bar sakta hai. c) agar discharge ho bhi jata hai to 20- 25 minutes ke baad ling phir uttejit ho sakta hai. Aap sex dobara kar sakte hain. ','Y','2017-11-20 21:41:56','N'),(93,'expert',902,0,'ek kondom pat sakta hai to 2 kondom chada kar sex karna thik hai kya',27,'Agar condom sahi tarike se na charaya jaye to woh phat sakta hai. Do condom ek sath nehi istemal karna cahiye . Dono condom ke beech gharsan se condom phat sakta hai.','Y','2017-11-21 10:48:56','N'),(94,'expert',902,0,'kya hospital se condom lena thik hai ya chamist se ache wale lene chahiye hispital ke condom jaldi pat jate hai kya',27,'Sarkari condom (hospital se liya hua) condom ki quality main aur chemist se liya hua condom ki quality mai farak nehi hota hai. Sirf pakaging ka farak hai. condom lagate waqt andar hawa na rehe is ka dhyaan rakhe. Water based lubricants ka istemal kare. oil based (tel ,ghee, cream, Vaseline) ke istemal se condom phat sakta hai. ','Y','2017-11-21 11:25:39','N'),(95,'expert',912,0,'gupt rog ke kya hota hai',23,'Gupt rog, wo bimaariyan hoti hain jo gupt angon per hoti hain aur yaun sambandh se phailti hain.\r\nUpchaar na karwaane per, ye yaun karte waqt, vyakti k partner ko bhi ho sakti hai.\r\nGupt rog, HIV/AIDS hone ka khatra badaate hain. Inse insaan napunsak bhi ho sakta hai. Kayi baar kuch gupt rog cancer bhi karwa dete hain','Y','2017-11-21 16:03:49','N'),(96,'expert',913,0,'sti kya  hai',23,'STI = Sexually transmitted Infections inhe yon rog/ gupt rog bhi kehte hain','Y','2017-11-21 16:06:21','N'),(97,'expert',912,0,'gupt rogo ko doctor ko batate samy hictkicahat hoto hai kya inke doctor alag se hote hai',27,'STI clinic alag hote hai jo sirf gupt rog ka elaj karte hai. App mai Resources -> STI Center mai kuch clinics ki jankari de gai hai.','Y','2017-11-21 16:31:15','N'),(98,'expert',913,0,'condom sti se bachata hai',27,'STI yani yaun sankraman sex ke dauran virya ya sarir ke anaya taral padarth ke adan pradan se phailta hai. sahi tarike se Condom ka proyog , Virya ke adan pradan ko rok kar sti hone se bachata hai. ','Y','2017-11-21 16:34:20','N'),(99,'expert',843,0,'sabrang is nice apps',27,'Thank you for the appreciation. ','Y','2017-11-21 23:34:57','N'),(100,'expert',843,0,'sir ma sex karta samya jaldi time out hu jata hu',27,'Pratyak waqti alag hote hai; is liye unka sex karne ke tarika bhi alag alag hota hai. Agar uttegana adhik ho to kai baar jaldi ejaculation (patan) ho jata hai aur santusti nehi mil pata. Sex ko lamba karne ke liye kuch tarike appna sakte hai a) Charam seema tak pahuch ne se pehle aapne aap ko kuch second ke liye rook le , is se us waqt uttejan kam ho jaigi aur aap kuch der aur sex kar payenge. b) PC muscles is exercise se bhi yeh waqt bar sakta hai. c) agar discharge ho bhi jata hai to 20- 25 minutes ke baad ling phir uttejit ho sakta hai. Aap sex dobara kar sakte hain.','Y','2017-11-21 23:36:14','N'),(101,'expert',911,0,'batal par khujli Jada ho tho Kya sti ho sakhta ha',23,'Batal pe khujli k karan:\r\n- Jung Joo\r\n- khujli - khaaris\r\nAgar batal k ched per khujli ho rahi hai to,\r\n- pet me kide ho sakte hain\r\n- sti ka discharge bhi ho sakta hai\r\n\r\nKripya doctor ko dikhaayein','Y','2017-11-22 11:46:36','N'),(102,'expert',901,0,'sir jadha sex krne se mera ling teda ho gya h please bto m kiya kru',23,'Ye ek galat dharna hai ki zyada sex karne se ling tedha ho jaata hai. Ling ki bnawat ki wajah se jab, umra k hisaab se badta hai tab wo apna sahi aakar leta hai.\r\nAgar ling itna tedha na ho ki sex karne me dikkat ho ya pisaab karne me dikkat ho, to wo normal hi maana jaata hai','Y','2017-11-22 14:40:55','N'),(103,'expert',900,0,'mera partner kisi aur se bHi sex krta h to m kese safe rhu aur muje se condom ni lgaya jata h.',23,'Apne aap ko safe rakhne sabse sahi aur asaan tarika hai, condom istemaal karna. \r\nCondom istemaal karne se aap HIV/AIDS aur Gupt rogon se bhi bache rahenge.\r\nIske alaawa aap PrEP namak dawaaiyaan bhi le sakte ho.. lekin wo aapko sirF HIV se bachaaegi, gupt rogon se nahin!','Y','2017-11-22 14:42:16','N'),(104,'expert',902,0,'kya hiv positive log negative se sadi kar skte hai',23,'Haan karskte hain.. bas kuch khyaal rakhna hota hai','Y','2017-11-22 16:35:19','N'),(105,'expert',903,0,'Man Shadi Kat sakte h',23,'haan ','Y','2017-11-22 16:40:47','N'),(106,'expert',903,0,'msm Shadi kar sakta h female se',23,'Haan kar skte hain','Y','2017-11-22 16:43:15','N'),(107,'expert',843,0,'muja sex Timing badna ka koi khralau upchar batya',27,'Aap PC muscles ki exercise kare is se kuch time baad sex karne ki time increase hone ki sambhavna hoti hai. Pesab karte waqt beech mein rook le.phir chore aur rook le. is tarah aap 3-5 bar kare.   ','Y','2017-11-23 00:37:25','N'),(108,'expert',901,0,'sir mene to kai br unsafe sex kiya h to kitne time period m muje