om phat jaye to , 3 mahine ka window period khatam hone ke baad HIV ki jaach zaruur karwani cahiye.','Y','2017-11-27 16:08:42','N'),(117,'expert',967,0,'mai jana chahti hn ki HIV ka aisa treatment kab',23,'HIV ka treatment, matlab HIV ki dwaiyaan, HIV infection ka pata chalte hi kar deni chaiye.\r\n','Y','2017-11-27 16:59:24','N'),(118,'expert',959,0,'halo',23,'Ji laxmi,Me aapki kya sahayata kar sakta hu?','Y','2017-11-27 22:33:40','N'),(119,'expert',988,0,'kya HiV ka ilaz a gya h? prep kya h?',23,'HIV ki dawaaiyaan abhi mojud hain, jinse aap puri zindagi sahi se guzaar sakte hain. \r\nPrEP = Pre Exposure Prophylaxis, Ye wo dawaaiyein hai jo HIV ka infection hone se rokti hain. ','Y','2017-11-30 13:51:54','N'),(120,'expert',1003,0,'I want to know srs and where can I go for reasimet surgery',23,'There is no WHO recognized SRS clinic in Delhi. How ever some private clinics operate and do SRS on very high charges.','Y','2017-11-30 16:45:06','N'),(121,'expert',457,0,'what is prep and where can I get free',27,'Prep is \"pre exposure prophylaxis\" . These are medicine which can be taken before/tentative exposure to HIV. ','Y','2017-12-04 17:20:15','N'),(122,'expert',457,0,'can you reply to my message?',27,'your query has been replied .','Y','2017-12-04 17:20:59','N'),(123,'expert',626,0,'what is latest treatment of hiv and when it will be come vaccine for it',23,'Latest treatment for HIV is known as ART (Anti Retroviral Therapy). They are pills that are taken on a daily basis which keep HIV replication under control. \r\nResearch is advancing on HIV Vaccine.. But no fixed date for its arrival for use.','Y','2017-12-04 17:39:40','N'),(124,'expert',963,0,'Sir mere Ling ke ander kuch white white dane se ho rhe h kiya muje checkup krana chaiye ye aksar ho jate h.',23,'Ling k andar huye daano k kayi karan ho sakte hain. Lekin karano k baare pata karne k liye unhe dekhna zaroori hota hai. \r\n\r\nLing k gole k charo taraf k daane kayi logon me normal bhi hote hai. Lekin kayi baaar yon rogon ki wajah se bhi pus is tarah se ikattha hota hai ki daano jaisa dikhta hai. Agar ye hi daaane, andkosh ki theli per hain to allergy bhi ho sakte hain.\r\nKripya apni jaanch karayein','Y','2017-12-04 22:34:35','N'),(125,'expert',962,0,'sex krne ke liye kis company ka condom sahi reheta h.',23,'Sex karne k liye aap kisi bhi company ka condom istemaal kar sakte hai. Lekin condom ki lambai aur expiry check kar leni chaiye. Iske alawa.. condom sahi se pehen na chaiye aur sex karte waqt... water based lubricant istemaal karna chaiye.','Y','2017-12-04 22:35:30','N');

