insert  into `tbl_survey_question` values (1,1,'I identify myself as:','में अपने आप को निम्न रूप में मानता हूँ ',1,'2017-01-04 11:55:56','N'),(1,2,'My education','मेरी शिक्षा ',1,'2017-01-04 11:57:56','N'),(1,3,'How do I describe my income sources','आय का स्रोत ',1,'2017-01-04 12:00:46','N'),(1,4,'My current relationship status','मेरे वर्तमान संबंध की स्तिथि',1,'2017-01-04 12:02:26','N'),(2,1,'Number of sexual encounters per week?','सप्ताह में सेक्स क्रिया की संख्या',1,'2017-01-05 11:21:06','N'),(2,2,'Whom do you have sex with?','क्या आपके पास स्थाई योन साथी है ?			\n',1,'2017-01-05 11:21:11','N'),(2,3,'Do you know your HIV status?','क्या आपको अपनी एच.आई.वी की स्तिथि का पता है ? ',1,'2017-01-05 11:21:39','N'),(2,4,'Do you use condom in every sexual act?','क्या आप हमेशा कंडोम का इस्तेमाल करते है ?							\r\n',1,'2017-01-05 11:21:56','N'),(2,5,'Have you ever been diagnosed with STI/STD?','क्या आपको कभी एस.टी.आई/एस.टी.डी हुआ है? 							\r\n',1,'2017-01-05 11:22:15','N'),(2,6,'Have you visited  doctor in last quarter?','क्या आपने पिछले तीन महीने में डॉ से मुलाकात की है 							\r\n',1,'2017-01-05 11:22:15','N'),(3,1,'Who is Bisexual?','द्विलिंगी कौन है?							\r\n',1,NULL,'N'),(3,2,'According to you what is risky behaviour?','आपके अनुसार जोख़िम पूर्ण व्यवहार क्या है?							\r\n',1,NULL,'N'),(3,3,'What is not form of sexual abuse?','इनमे से क्या यौन दुर्वव्हार  का रूप नहीं है?							\r\n',1,NULL,'N'),(3,4,'A person born with the male sex can feel that they belong to the female gender and vice versa?','पुरुष यौन अंगों के साथ पैदा हुआ व्यक्ति महसूस कर सकता हूँ कि वे महिला है 							\r\n',1,NULL,'N'),(3,5,'Hetrosexuals are?','विषमलैंगिक कौन है?							',1,NULL,'N'),(3,6,'Gay, bisexual, kothi, giriya and panthi is?','गे, बायोसेक्सुँल, कोती, गिरिया और पंथी क्या है 							\r\n',1,NULL,'N'),(3,7,'Lack of sexual attraction to anyone, or low or absent interest in or desire for sexual activity is?','यौन क्रियाओं मैं रूचि की कमी और किसी से भी यौनिक आकर्षण न होना क्या होता है 							\r\n',1,NULL,'N'),(3,8,'A Transgender person identifies emotionally different than the sexual organ being born with?','एक ट्रांसजेंडर व्यक्ति अपने आप को जन्म जात लिंग से भावनात्मक रूप से भिनन महसूस करता है 							\r\n',1,NULL,'N'),(3,9,'Hijra is a community of male to female transgender individuals who stay together, usually in a Dera with guru?','हिजड़ा समुदाय ज़्यादातर गुरु के साथ डेरे मैं रहते हैं    \r\n',1,NULL,'N'),(3,10,'Individuals who derive sexual pleasure by wearing clothes usually worn by the opposite gender but are is a heterosexual?','विपरीत लिंग जैसे पहनावे को अपना कर, विपरीत लिंग के व्यक्ति के साथ यौन क्रिया  करने वाले को क्या कहते हैं  							\r\n',1,NULL,'N'),(4,1,'What is the differnece between HIV positive and AIDS infected patients?','एच.आई.वी पॉजिटिव और एड्स से संक्रमित रोगी में क्या अंतर है?							\r\n',1,NULL,'N'),(4,2,'As per data,which form of transmission has maximum role in HIV burden in India?','आंकड़ों के अनुसार, भारत में एच.आई.वी बोझ का किस प्रकार के संचार की अधिकतम भूमिका है?							\r\n',1,NULL,'N'),(4,3,'Which of the following statement is wrong?						\r\n','इनमे से कौन सा कथन असत्य है? 							\r\n',1,NULL,'N'),(4,4,'Can someone get HIV through unprotected anal sex?','असुरक्षित गुदा सेक्स से एच.आई.वी प्राप्त कर सकतें है?							\r\n',1,NULL,'N'),(4,5,'Can someone get HIV from injecting drug?','नशीली सुइयों से एच.आई.वी. प्राप्त कर सकतें है?							',1,NULL,'N'),(4,6,'Injecting drugs and alcohol before sex is?','सम्भोग के पहले शराब का सेवन और ड्रग्स का प्रयोग क्या है ?							\r\n',1,NULL,'N'),(4,7,'What is HIV?','एच.आई.वी क्या है?							\r\n',1,NULL,'N'),(4,8,'What is AIDS?','एड्स क्या है?							\r\n',1,NULL,'N'),(4,9,'Duration of 3 months is necessary for a person to show authentic result of the HIV test if it has been contracted called?','एचआईवी परीक्षण के प्रामाणिक परिणाम देखने के लिए किसी व्यक्ति को तीन महीने की अवधि जरूरी है,  इस अवधि को क्या कहते हैं?							\r\n',1,NULL,'N'),(4,10,'ART stand for?','ए.आर.टी इनमें से क्या है?							\r\n',1,NULL,'N'),(5,1,'Does prescence of STI increases the risk  of acquiring and transmitting HIV?','क्या इस.टी.आई संक्रमण शरीर मैं मौजूद होने से एच.आई.वी होने का जोखिम बढ़ जाता है ?							\r\n',1,NULL,'N'),(5,2,'Which of the below statement are correct for STI management?','एस.टी.आई के प्रबंधन के लिए इनमे से कौन सा कथन सही है? 							\r\n',1,NULL,'N'),(5,3,'Which of the below is not symptom of STI?','इनमे से कौन सा एस.टी.आई का लक्षण नहीं है?							\r\n',1,NULL,'N'),(5,4,'STI stand for?','एस.टी.आई क्या है ? 							\r\n',1,NULL,'N'),(5,5,'Hepatitis is often symptomless; many infected people may discover Hepatitis only when they start having a liver problem?						','हेपेटाइटिस अक्सर लक्षण रहित होता है; कई संक्रमित लोग तभी हेपेटाइटिस का पता कर सकते हैं, जब वे लिवर की समस्या से अवगत होते हैं|							\r\n',1,NULL,'N'),(5,6,'STD transmitted through?','यौन संचारित रोग किसके माध्यम से फैलता है							\r\n',1,NULL,'N'),(5,7,'The herpes that is spread sexually is generally called \'\'herpes zoster\'\'.','हर्पीज जो यौन क्रिया से फैलता है, आमतौर पर \"हर्पीस जोस्टर\" (छाजन-दाद) कहलाता है?							\n',1,NULL,'N'),(5,8,'Hep B & Hep C can be transmitted by?','हेपेटाइटिस -बी एवं हेपेटाइटिस -सी निम्न द्वारा प्रसारित किया जा सकता है 							\r\n',1,NULL,'N'),(5,9,'Is vaccine available for hepatitis C?','क्या हेपेटाइटिस -सी के लिए टीका है?							\r\n',1,NULL,'N'),(5,10,'Can mastrubation cause STIs/STDs?','क्या हस्तमैथुन से एस.टी.आई और एस.टी.डी हो सकता है?							\n',1,NULL,'N'),(6,1,'Does Stigma & Discrimination increases MSM/TG\'\'s  risk to HIV?','क्या कलंक और भेदभाव एम.एस.एम/ट्रांसजेंडर के लिए एच.आई.वी के रिस्क को बढ़ाता है?							\r\n',1,NULL,'N'),(6,2,'Is Stigma as same as discrimination?','क्या कलंक और भेदभाव एक चीज़ हैं ? 							\r\n',1,NULL,'N'),(6,3,'Which of the below statement do not reflect Stigma and Discrimination?','इनमें से कौन से कथन कलंक और भेदभाव को नहीं दर्शाते?							\r\n',1,NULL,'N'),(6,4,'Stigma refers to disapproval of a person or group on characteristics that are different from the society on certain norms?','जब किसी व्यक्ति या समुदाय को समाज की प्रथायों से अलग देखा जाता है और इसलिए उन्हें अस्वाकृत किया जाता है, उसे कलंक कहते हैं  							\r\n',1,NULL,'N'),(6,5,'Gossiping, isolating or making fun of someone is?','गपशप,अलग-थलग या किसी का मजाक बनाना क्या है?							\r\n',1,NULL,'N'),(6,6,'Stigma can be faced by?','साधारणतः कलंक का सामना कौन कर सकते है 							\r\n',1,NULL,'N'),(6,7,'Recurrent thoughts of death, recurrent suicidal ideation without a specific plan, or a suicide attempt or a specific plan for committing suicide is\n','बारम्बार आत्म्यहत्या के विचार या आत्महत्या करने की कोशिश या आत्महत्या करने के लिए एक विशेष योजना बनाना \n',1,NULL,'N'),(6,8,'Treating a person badly because of how they look/behaviour/ status/negative incident is?','किसी व्यक्तो को उसके पहनावे, व्यहवार, स्तिथि, नकारात्मक घटना के आधार पर दुर्व्यवार करने को क्या कहते हैं ? 							\r\n',1,NULL,'N'),(6,9,'Stigma is a process of creating a \'\'spoilded identity\'\' of an individual or a group of individuals?','कलंक एक पहचान किसी व्यक्ति या व्यक्तियों के एक समूह के ख़राब बनाने की एक प्रक्रिया है 							\n',1,NULL,'N'),(6,10,'Does depression has any symptoms?','क्या डिप्रेशन के लक्षण है?							\r\n',1,NULL,'N'),(7,1,'What is section 377 of Indian penal code?','भारतीय दंड संहिता की धारा 377 क्या है?							\r\n',1,NULL,'N'),(7,2,'Is sex work legal in India?','सेक्स कार्य भारत में कानूनी है 							\r\n',1,NULL,'N'),(7,3,'When did supreme court legally anounced Transgender as third gender?','सर्वोच्च न्यायालय ने कब कानूनी तौर पर तीसरे लिंग के रूप में ट्रांसजेंडर की घोषणा की थी? 							\r\n',1,NULL,'N'),(7,4,'Delhi High court decreminalize 377 in?','दिल्ली उच्च न्यायालय ने 377 को खंडित कर दिया था 							\r\n',1,NULL,'N'),(7,5,'Supreme court recriminalize homosexuality in?','सुप्रीम कोर्ट ने फिर से समलैंगिकता को कब अपराध बनाया ?							\r\n',1,NULL,'N'),(7,6,'Which NGO has filed a curative petition in the Supreme Court of India in 2014?','किस गैर सरकारी संगठन ने 2014 में भारत के उच्त्तम न्यायालय में एक उपचारात्मक याचिका दायर की है? 							\r\n',1,NULL,'N'),(7,7,'Nalsa stand for?','एन.ए.एल.एस.ए/नालसा क्या है? 							\n',1,NULL,'N'),(7,8,'Which state has released the \'\'State Policy\'\' for Transgender persons in 2015?','किस राज्य ने ट्रांसजेंडर व्यक्तियों के लिए 2015 में \" राज्य नीति\"  घोषित की है?							\r\n',1,NULL,'N'),(7,9,'District legal service authority work at?','जिला क़ानूनी सेवा प्राधिकरण किस स्तर पर काम करता है?							\r\n',1,NULL,'N'),(7,10,'SRS stand for?','एस.आर.एस क्या है 							\n',1,NULL,'N');

