/*Table structure for table `tbl_tips` */

DROP TABLE IF EXISTS `tbl_tips`;

CREATE TABLE `tbl_tips` (
  `tipsId` int(11) NOT NULL AUTO_INCREMENT,
  `type` varchar(255) DEFAULT NULL,
  `typeHindi` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `tips` varchar(255) DEFAULT NULL,
  `tipsHindi` varchar(255) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT NULL,
  `createdBy` int(11) DEFAULT NULL,
  `deleted` enum('Y','N') DEFAULT 'N',
  PRIMARY KEY (`tipsId`)
) ENGINE=InnoDB AUTO_INCREMENT=35 DEFAULT CHARSET=latin1;

/*Data for the table `tbl_tips` */

insert  into `tbl_tips` values (7,'','','Risk of getting infected by HIV increases four times after STI ','एसटीआई के बाद एचआईवी से संक्रमित होने का जोखिम चार गुना बढ़ जाता है',1,'Y'),(11,'','','AAAAAAAAa','एसटीआई के बाद एचआईवी से संक्रमित होने का जोखिम चार गुना बढ़ जाता है',1,'Y'),(12,'AAAAAA','क्या आपको अपनी एच.आ','CCCCCCCc','क्या आपको अपन',1,'Y'),(13,'Share your story','एड्स इतिहास में सबसे अधिक अध्ययन की गई बीमारी है ','Share your story','एड्स इतिहास में सबसे अधिक अध्ययन की गई बीमारी है ',1,'Y'),(14,'According to Hindu Epic Mahabharata ,Arjuna lived as a kinner for one year as Brihannala.','हिंदू महाकाव्य महाभारत के अनुसार, अर्जुन एक वर्ष तक किन्नर रूप धारण कर ब्रिह्नल्ला के रूप में रहे |','According to Hindu Epic Mahabharata ,Arjuna lived as a kinner for one year as Brihannala.','हिंदू महाकाव्य महाभारत के अनुसार, अर्जुन एक वर्ष तक किन्नर रूप धारण कर ब्रिह्नल्ला के रूप में रहे |',1,'N'),(15,'If you and your partner are both HIV positive unprotected sex may result in one or both in getting an STI or a different strain of HIV.','यदि आप और आपके साथी एच.आई.वी पॉजिटिव हैं तथा असुरक्षित यौन संबंध कर रहे हैं तो एस.टी.आई हो सकता है या एच.आई.वी के विभिन्न प्ररूप हो सकते हैं','If you and your partner are both HIV positive unprotected sex may result in one or both in getting an STI or a different strain of HIV.','यदि आप और आपके साथी एच.आई.वी पॉजिटिव हैं तथा असुरक्षित यौन संबंध कर रहे हैं तो एस.टी.आई हो सकता है या एच.आई.वी के विभिन्न प्ररूप हो सकते हैं',26,'N'),(16,'HIV treatment is easier and safer than ever. Though side effects are possible, treatment prolongs health and survival and reduces the risk of HIV transmission',' एच.आई.वी उपचार पहले से कहीं ज्यादा आसान और सुरक्षित है। हालांकि दुष्प्रभाव संभव है, उपचार स्वास्थ्य और अस्तित्व को बढ़ाता है और एच.आई.वी संचरण के जोखिम को कम करता है।','HIV treatment is easier and safer than ever. Though side effects are possible, treatment prolongs health and survival and reduces the risk of HIV transmission',' एच.आई.वी उपचार पहले से कहीं ज्यादा आसान और सुरक्षित है। हालांकि दुष्प्रभाव संभव है, उपचार स्वास्थ्य और अस्तित्व को बढ़ाता है और एच.आई.वी संचरण के जोखिम को कम करता है।',26,'N'),(17,'Water is important for life and is necessary every day. A person needs about eight glass of water per day.','पानी जीवन के लिए महत्वपूर्ण है और हर दिन आवश्यक है। एक व्यक्ति को प्रति दिन आठ ग्लास पानी की जरूरत होती है।','Water is important for life and is necessary every day. A person needs about eight glass of water per day.','पानी जीवन के लिए महत्वपूर्ण है और हर दिन आवश्यक है। एक व्यक्ति को प्रति दिन आठ ग्लास पानी की जरूरत होती है।',26,'N'),(18,'Government of India provides free ART to all HIV infected persons.','भारत सरकार सभी एच.आई.वी. संक्रमित व्यक्तियों को मुफ्त ए.आर.टी. प्रदान करती है।','Government of India provides free ART to all HIV infected persons.','भारत सरकार सभी एच.आई.वी. संक्रमित व्यक्तियों को मुफ्त ए.आर.टी. प्रदान करती है।',26,'N'),(19,' “PrEP” stands for Pre-Exposure Prophylaxis can help stop the HIV virus from “taking hold” and spreading if and when exposed.','“PrEP” का अर्थ पूर्व अनावरण रोकथाम से है जो एच.आई.वी. विषाणु को पता चलने पर फैलने से रोकता है  ',' “PrEP” stands for Pre-Exposure Prophylaxis can help stop the HIV virus from “taking hold” and spreading if and when exposed.','“PrEP” का अर्थ पूर्व अनावरण रोकथाम से है जो एच.आई.वी. विषाणु को पता चलने पर फैलने से रोकता है  ',26,'N'),(20,'Alcohol and substance use lowers inhibition and ability to think critically and may lead to make risky decisions','शराब और मादक द्रव्यों का उपयोग गंभीर रूप से सोचने की क्षमता को निषेध और कम करती है व जोखिम भरा निर्णय करने के लिए नेतृत्व कर सकती है ।','Alcohol and substance use lowers inhibition and ability to think critically and may lead to make risky decisions','शराब और मादक द्रव्यों का उपयोग गंभीर रूप से सोचने की क्षमता को निषेध और कम करती है व जोखिम भरा निर्णय करने के लिए नेतृत्व कर सकती है ।',26,'N'),(21,'','','','',26,'Y'),(22,'Choose whole grains. Try brown rice instead of white. Switch to whole wheat pasta.','साबुत अनाज चुनें भूरे रंग के चावल की बजाय सफेद कोशिश करो पूरे गेहूं पास्ता पर स्विच करें','Choose whole grains. Try brown rice instead of white. Switch to whole wheat pasta.','साबुत अनाज चुनें भूरे रंग के चावल की बजाय सफेद कोशिश करो पूरे गेहूं पास्ता पर स्विच करें',1,'Y'),(23,'    Cut down on processed foods, sugar, salt, and saturated fat.','साबुत अनाज चुनें भूरे रंग के चावल की बजाय सफेद कोशिश करो पूरे गेहूं पास्ता पर स्विच करें','    Cut down on processed foods, sugar, salt, and saturated fat.','साबुत अनाज चुनें भूरे रंग के चावल की बजाय सफेद कोशिश करो पूरे गेहूं पास्ता पर स्विच करें',26,'Y'),(24,'Asking questions from the experts will support you in clarifying your problems.','विशेषज्ञों के प्रश्न पूछने से आप अपनी समस्याओं को स्पष्ट करने में सहायता करेंगे','Asking questions from the experts will support you in clarifying your problems.','विशेषज्ञों के प्रश्न पूछने से आप अपनी समस्याओं को स्पष्ट करने में सहायता करेंगे',26,'N'),(25,'It is a myth that Hijras take the host’s luck away if turned empty-handed from a wedding or a celebration.','यह एक मिथक है कि हिजड़े मेजबान के भाग्य को हर लेता है अगर शादी या उत्सव से खाली हाथ निकलता है।','It is a myth that Hijras take the host’s luck away if turned empty-handed from a wedding or a celebration.','यह एक मिथक है कि हिजड़े मेजबान के भाग्य को हर लेता है अगर शादी या उत्सव से खाली हाथ निकलता है।',26,'N'),(26,'','','','',26,'Y'),(27,'HIV may not cause any symptoms for several years.','एच.आई.वी. कई वर्षों तक किसी भी लक्षण का कारण नहीं हो सकता।','HIV may not cause any symptoms for several years.','एच.आई.वी. कई वर्षों तक किसी भी लक्षण का कारण नहीं हो सकता।',26,'N'),(28,'•	There are three types of tests which tell the results of the HIV. PCR, Elisa and P24 antigen. ','तीन प्रकार के परीक्षण जो एच.आई.वी. के परिणाम बता सकते हैं - पीसीआर, एलिसा और पी 24 एंटीजन ','•	There are three types of tests which tell the results of the HIV. PCR, Elisa and P24 antigen. ','तीन प्रकार के परीक्षण जो एच.आई.वी. के परिणाम बता सकते हैं - पीसीआर, एलिसा और पी 24 एंटीजन ',26,'N'),(29,'HIV do not spread through kissing & mosquito bite ','एचआईवी चुंबन और मच्छर काटने के माध्यम से नही फैलता','HIV do not spread through kissing & mosquito bite ','एचआईवी चुंबन और मच्छर काटने के माध्यम से नही फैलता',26,'N'),(30,'The risk of transmission of HIV through sexual contact is 1% still 80% of all HIV infected cases are reported to have spread through unsafe sex.','यौन संपर्क के माध्यम से एचआईवी के संचरण का  जोखिम 1% है ,अब तक सभी एचआईवी संक्रमण के 80% मामले असुरक्षित सेक्स के माध्यम से फैलने की सुचना है।','The risk of transmission of HIV through sexual contact is 1% still 80% of all HIV infected cases are reported to have spread through unsafe sex.','यौन संपर्क के माध्यम से एचआईवी के संचरण का  जोखिम 1% है ,अब तक सभी एचआईवी संक्रमण के 80% मामले असुरक्षित सेक्स के माध्यम से फैलने की सुचना है।',26,'N'),(31,'Please read and take the quiz within the application. See if you win reward!! ','इस आप्लिकेशन मैं पढ़े और क्विज लें. आप रिवॉर्ड जीत सकते हैं और डॉक्टर से किसी भी तरह का सवाल पूछ सकते हैं! ','Please read and take the quiz within the application. See if you win reward!! ','इस आप्लिकेशन मैं पढ़े और क्विज लें. आप रिवॉर्ड जीत सकते हैं और डॉक्टर से किसी भी तरह का सवाल पूछ सकते हैं! ',26,'N'),(32,'A HIV positive person can have normal children','एक एच.आई.वी. पॉजिटिव व्यक्ति के सामान्य बच्चे हो सकते हैं।','A HIV positive person can have normal children','एक एच.आई.वी. पॉजिटिव व्यक्ति के सामान्य बच्चे हो सकते हैं।',26,'N'),(33,'We are very excited about the 10th Delhi Queer Pride this year! 12th November, 2017, Sunday. Come in massive numbers. ','सभी को दसवीं दिल्ली क्वीयर प्राइड में शामिल होने का खुला आमंत्रण है। 12th November, 2017,  रविवार! आइये इस साल को पिछले सालों से भी ज़्यादा शानदार बनाएं।','We are very excited about the 10th Delhi Queer Pride this year! 12th November, 2017, Sunday. Come in massive numbers. ','सभी को दसवीं दिल्ली क्वीयर प्राइड में शामिल होने का खुला आमंत्रण है। 12th November, 2017,  रविवार! आइये इस साल को पिछले सालों से भी ज़्यादा शानदार बनाएं।',26,'N'),(34,'HIV is the strongest risk factor for developing active TB disease','एच.आई.वी. सक्रिय टी.बी. रोग के विकास के लिए सबसे मजबूत जोखिम कारक है।','HIV is the strongest risk factor for developing active TB disease','एच.आई.वी. सक्रिय टी.बी. रोग के विकास के लिए सबसे मजबूत जोखिम कारक है।',26,'N');

/*Table structure for table `tbl_usernotificationsetting` */

DROP TABLE IF EXISTS `tbl_usernotificationsetting`;

CREATE TABLE `tbl_usernotificationsetting` (
  `notificationId` int(11) NOT NULL AUTO_INCREMENT,
  `userId` varchar(100) DEFAULT NULL,
  `textMessages` enum('Y','N') DEFAULT 'Y',
  `pushNotifications` enum('Y','N') DEFAULT 'Y',
  `deleted` enum('Y','N') DEFAULT 'N',
  `createdDate` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updatedDate` datetime DEFAULT NULL,
  PRIMARY KEY (`notificationId`)
) ENGINE=InnoDB AUTO_INCREMENT=625 DEFAULT CHARSET=latin1;

