/* Procedure structure for procedure `proc_dropDown_fetch` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_dropDown_fetch` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_dropDown_fetch`(
/*
call proc_dropDown_fetch('','QuizDetails')
*/
p_language varchar(55),
p_type varchar(55)    
    )
BEGIN
if p_type='HealthLocator' and p_language ='Hindi'
then
SELECT * FROM tbl_healthlocator WHERE deleted='N';
else 
SELECT * FROM tbl_healthlocator WHERE deleted='N';
end if;
IF p_type='QuizDetails'
THEN
SELECT a.createdBy,
(SELECT firstName FROM tbl_users WHERE a.createdBy=userId AND deleted='N' AND otpVerify='Y')userName,
(SELECT mobile FROM tbl_users WHERE a.createdBy=userId AND deleted='N' AND otpVerify='Y')mobile,
a.surveyId,
(SELECT survey FROM tbl_survey WHERE tbl_survey.surveyId=a.surveyId  AND deleted='N' )surveyName,
COUNT(a.rating)surveyCorrectAnswer,
(SELECT COUNT(rating) FROM tbl_surveytrans t WHERE t.createdBy=a.createdBy AND t.surveyId  IN(3,4,5,6,7)AND rating=1)
totalCorrectAnswer
FROM tbl_surveytrans a
WHERE a.deleted='N'
AND a.createdBy IN (SELECT userId FROM tbl_users WHERE deleted='N' AND otpVerify='Y'
)
AND a.surveyId  IN (3,4,5,6,7)
AND a.rating=1
AND a.createdBy IN (SELECT createdBy FROM tbl_surveytrans WHERE surveyId  IN(3,4,5,6,7) 
                    AND deleted='N' GROUP BY createdBy 
                    HAVING COUNT(createdBy)=50)
GROUP BY a.createdBy,a.surveyId;
END IF;
    END */$$
DELIMITER ;

