/* Procedure structure for procedure `proc_login_validation` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_login_validation` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_login_validation`(
/*
Procedure Name - proc_login_validation
Purpose        - To validate the login of users
Author         - Shashank Chauhan
Date           - 30/12/2016
CALL proc_login_validation('9650221794','123456','')
*/
p_userType varchar(50),
p_userName VARCHAR(50), 
p_password VARCHAR(50),
p_gcmId    VARCHAR(255)
)
BEGIN
  /***Insert start***/
	if p_userType = 'webUser'
	then
        	
	IF NOT EXISTS(SELECT email FROM tbl_users WHERE email=p_userName AND deleted='N' AND userType IN ('Admin','Expert'))
	THEN 
	    SELECT 0 responseCode,'Please enter valid User!' responseMessage;
	   ELSE IF p_password !=(SELECT PASSWORD FROM tbl_users WHERE  email=p_userName AND deleted='N' AND userType IN ('Admin','Expert'))
	THEN
	    SELECT 0 responseCode,'Please enter valid password!' responseMessage;
	ELSE  
	    SELECT 200 responseCode ,'User login successfully!' responseMessage,
	    t1.*,
	    CONCAT((SELECT `value` FROM tbl_parameter WHERE `name`='URL'),'uploads/profileImage/',t1.profileImage)profileImage
	     FROM tbl_users t1
	    WHERE t1.email=p_userName 
	    AND t1.password=p_password AND userType IN ('Admin','Expert');
	END IF;
	END IF;
	
	else
	
	IF NOT EXISTS(SELECT mobile FROM tbl_users WHERE mobile=p_userName AND deleted='N' AND otpVerify='Y')
	THEN 
	    SELECT 0 responseCode,'Please enter valid User!' responseMessage;
	ELSE IF IFNULL(p_password,'')=''
	THEN
	    SELECT 0 responseCode,'Please enter password!' responseMessage;
	ELSE IF p_password !=(SELECT PASSWORD FROM tbl_users WHERE  mobile=p_userName AND deleted='N' AND otpVerify='Y')
	THEN
	    SELECT 0 responseCode,'Please enter valid password!' responseMessage;
	ELSE  
	    UPDATE tbl_users
	    SET gcmId=p_gcmId,updatedDate=NOW()
	    WHERE  mobile=p_userName 
	    AND `password`=p_password AND deleted='N' AND otpVerify='Y';  
  
	    SELECT 200 responseCode ,'User login successfully!' responseMessage,
	    t1.*,
	    CONCAT((SELECT `value` FROM tbl_parameter WHERE `name`='URL'),'uploads/profileImage/',t1.profileImage)profileImage
	    FROM tbl_users t1
	    WHERE t1.mobile=p_userName 
	    AND t1.password=p_password AND deleted='N' AND otpVerify='Y';
	END IF;
	END IF;
	end if;
	END IF;
	
END */$$
DELIMITER ;

