/* Procedure structure for procedure `proc_users_iud` */

/*!50003 DROP PROCEDURE IF EXISTS  `proc_users_iud` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`sanjiv`@`%` PROCEDURE `proc_users_iud`(
/*
Procedure Name - proc_users_iud
Purpose        - To insert, update, delete, view data in table- users
Author         - Shashank Chauhan
Date           - 30/12/2016
CALL proc_users_iud('0',0,'Shashank','Chauhan','shashank@vartulz.com','9650221794','35','Male','123456','India','Koala.jpg','1',0)*/
p_mode TINYINT,
p_NuserId VARCHAR(11),
p_firstName VARCHAR(50)CHARSET utf8,
p_lastName VARCHAR(50),
p_email VARCHAR(100), 
p_mobile VARCHAR(10), 
p_age INT,
p_gender VARCHAR(10)CHARSET utf8,
p_newPassword VARCHAR(50),
p_location VARCHAR(100)CHARSET utf8,
p_profileImage VARCHAR(255),
p_considerMyself VARCHAR(50),
p_education VARCHAR(50),
p_incomeSource VARCHAR(50),
p_relationStatus VARCHAR(50),
p_userId varchar(11),
p_oldPassword VARCHAR(50),
p_otp INT(11),
p_gcmId varchar(255)
)
BEGIN
 
   /***Insert start***/
   
    IF p_mode ='0'
    THEN
    IF IFNULL(p_firstName,'')=''
    THEN
    SELECT '0' responseCode, 'Please enter First name!!!' responseMessage;
    ELSE IF IFNULL(p_mobile,'')=''
    THEN
    SELECT '0' responseCode, 'Mobile No can not be blank!' responseMessage;
    ELSE IF  LENGTH(p_mobile)!=10
    THEN
    SELECT '0' responseCode, 'Please enter valid 10 digit mobile No' responseMessage;
    ELSE IF EXISTS(SELECT * FROM tbl_users WHERE mobile = p_mobile AND deleted='N' and otpVerify = 'Y') 
    THEN
    SELECT '0' responseCode, 'This Mobile Number is already used' responseMessage;
    ELSE IF LENGTH(p_newPassword)<6
    THEN
    SELECT '0' responseCode, 'Password must be at least 6 character long!!!' responseMessage;
    ELSE IF LENGTH(p_age) > 2
    THEN
     SELECT '0' responseCode, 'Please Enter Valid Age' responseMessage;
    else if p_gender = 'लिंग चुनें'
    then
     SELECT '0' responseCode, 'Please Select Gender' responseMessage;
    else if p_location is null
    then
     SELECT '0' responseCode, 'Please Select Location' responseMessage;
    ELSE 
     INSERT INTO tbl_users
     (userType,firstName,lastName,email,mobile,age,gender,`password`,otp,location,profileImage,createdBy,createdDate)
	VALUES
      ('User',p_firstName,p_lastName,p_email,p_mobile,p_age,p_gender,p_newPassword,p_otp,p_location,p_profileImage,p_userId,DATE_ADD(NOW(),INTERVAL 330  MINUTE));
    SELECT *,200 responseCode, 'User Created successfully!' responseMessage from tbl_users where userId=(select max(userId) from tbl_users);
   
        IF NOT EXISTS(SELECT userId FROM tbl_usernotificationsetting 
		WHERE userId = (SELECT MAX(userId)FROM tbl_users  WHERE deleted='N') AND deleted='N')
     THEN 
        INSERT INTO tbl_usernotificationsetting(userId)
         VALUES((SELECT MAX(userId)FROM tbl_users WHERE deleted='N'));
    END IF;   
    END IF;      
    END IF;
    END IF;
    END IF;
    END IF;
    END IF;
    END IF;
    END IF;
    END IF;
   /***Insert End***/
   
   
   /***Update Start***/   
    IF p_mode=1
    THEN
    IF IFNULL(p_firstName,'')=''
    THEN
    SELECT '0' responseCode, 'Please enter First name!!!' responseMessage;
    ELSE IF EXISTS(SELECT * FROM tbl_users WHERE mobile = p_mobile AND userid!=p_userId AND deleted='N' and otpVerify='Y')
    THEN
    SELECT '0' responseCode, 'This Mobile Number is already Used by other User' responseMessage;
    ELSE IF p_gender = 'लिंग चुनें'
    THEN
     SELECT '0' responseCode, 'Please Select Gender' responseMessage;
    ELSE IF p_location is null
    THEN
     SELECT '0' responseCode, 'Please Select Location' responseMessage;
    ELSE 
     
     UPDATE tbl_users
     SET firstName=p_firstName,email=p_email,age=p_age,
     gender=p_gender,location=p_location,gcmId = gcmId,
     updatedBy=p_userId,updatedDate=NOW()
    WHERE userId=p_userId AND deleted='N';
    SELECT *,'200' responseCode, 'User updated successfully!' responseMessage from tbl_users where userId=p_userId;
    END IF;
    END IF;
    END IF;
    END IF;
    END IF;
    
   /***Update End***/
   
   
   
   /***Delete Start***/    
       IF p_mode=2
    THEN 
     
     UPDATE tbl_users
     SET deleted='Y',updatedDate=NOW(),updatedBy=p_userId
    WHERE userId=p_NuserId AND deleted='N';	
    SELECT '200' responseCode, 'User deleted successfully!' responseMessage;
    END IF;  
  
   /***Delete End***/  
    
    
   
   /***View Start***/ 
       IF p_mode=3
    THEN 
     
    SELECT userId,firstName,lastName,email,mobile,age,gender,PASSWORD,location,profileImage,gcmId,
	IFNULL(profileImage,'avtarmale.png') AS profileImage,deleted,userType,createdDate
	FROM  tbl_users 
    WHERE userId=IFNULL(NULLIF(REPLACE(p_NuserId,0,''),''),userId) 
    AND deleted = 'N';	
         
    END IF;  
   /***View End***/   
   
   
   /***Change Password Start***/ 
    
    IF p_mode=4
    THEN 
    IF IFNULL(CAST(p_NuserId AS CHAR(50)),'')IN('',0)   
    THEN
    SELECT 0 responseCode,'Internal parameter missing!' responseMessage; 
    ELSE IF NOT EXISTS(SELECT * FROM tbl_users WHERE userId = p_NuserId AND deleted='N')
    THEN
    SELECT 0 responseCode,'Enter Valid User' responseMessage; 
 --   ELSE IF IFNULL(p_newPassword,'') IN ('',0) 
 --   THEN
 --   SELECT 0 responseCode,'Please Enter New Password!' responseMessage;
    ELSE IF LENGTH(p_newPassword)<6 
    THEN
    SELECT 0 responseCode,'Password must be at least 6 character long!!!' responseMessage;
    ELSE IF p_newPassword IN ('',NULL) OR p_newPassword IS NULL
    THEN
    SELECT 0 responseCode,'Password Can not be blank!' responseMessage; 
    ELSE
    UPDATE tbl_users
    SET PASSWORD=p_newPassword,updatedDate=NOW()
    WHERE userId=p_NuserId;
    SELECT 200 responseCode,'Password Change Successfully' responseMessage,PASSWORD 
    FROM tbl_users WHERE userId=p_NuserId  AND deleted='N'; 
    
    END IF;
    END IF;
    END IF;
    END IF;
   -- END IF;
         
    END IF;  
   /***Change Password End***/
   
   /***Profile image update start***/ 
    
    IF p_mode=5    
    THEN
   IF IFNULL(p_profileImage,'')=''
   THEN  
	SELECT 0 responseCode,'Profile image Cant be blank' responseMessage,profileImage FROM tbl_users 
		WHERE userId=p_NuserId AND deleted = 'N'; 
    ELSE 
    UPDATE tbl_users
    SET profileImage=p_profileImage,updatedDate=NOW()
    WHERE userId=p_NuserId AND deleted = 'N';
    SELECT 200 responseCode,'Profile image updated successfully' responseMessage,profileImage 
    FROM tbl_users WHERE userId=p_NuserId AND deleted = 'N'; 
    END IF;
   END IF;
   /***Profile image update start***/
   
    
   
   
    END */$$
DELIMITER ;

